  `estado` varchar(255) DEFAULT NULL,
  `idNumeroGrupo` bigint(20) DEFAULT NULL,
  `idTFC` varchar(255) NOT NULL,
  `numeroAluno` varchar(255) DEFAULT NULL,
  `ordemEscolha` int(11) DEFAULT NULL,
  `registoDeInscricao` datetime DEFAULT NULL,
  `anoLetivo` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_Inscricao_Grupo` (`idNumeroGrupo`),
  KEY `FK_Inscricao_Aluno` (`numeroAluno`),
  KEY `FK_Inscricao_TFC` (`idTFC`),
  CONSTRAINT `FK_Inscricao_Aluno` FOREIGN KEY (`numeroAluno`) REFERENCES `Aluno` (`numeroAluno`),
  CONSTRAINT `FK_Inscricao_Grupo` FOREIGN KEY (`idNumeroGrupo`) REFERENCES `Grupo` (`id`),
  CONSTRAINT `FK_Inscricao_TFC` FOREIGN KEY (`idTFC`) REFERENCES `TFC` (`idtfc`),
  CONSTRAINT `CK_Inscricao_OrdemEscolha` CHECK (`ordemEscolha` between 1 and 6),
  CONSTRAINT `CK_registoAno_coerente` CHECK (substr(`registoDeInscricao`,1,4) = `anoLetivo`),
  CONSTRAINT `CK_Inscricao_TipoIdentificacao` CHECK (`idNumeroGrupo` is not null and `numeroAluno` is null or `idNumeroGrupo` is null and `numeroAluno` is not null)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
