CREATE TABLE `TFC` (
  `id` bigint(20) NOT NULL,
  `Titulo` varchar(255) DEFAULT NULL,
  `anoLetivo` varchar(255) DEFAULT NULL,
  `avaliacaoProposta` varchar(255) DEFAULT NULL,
  `coorientador` varchar(255) DEFAULT NULL,
  `dataEstado` varchar(255) DEFAULT NULL,
  `dataProposta` varchar(255) DEFAULT NULL,
  `descricao` text DEFAULT NULL,
  `entidade` bigint(20) DEFAULT NULL,
  `estado` varchar(255) DEFAULT NULL,
  `idGrupo` bigint(20) DEFAULT NULL,
  `idtfc` varchar(255) NOT NULL,
  `motivoRecusa` varchar(255) DEFAULT NULL,
  `orientador` varchar(255) DEFAULT NULL,
  `preponente` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`idtfc`),
  KEY `FK_TFC_Grupo` (`idGrupo`),
  KEY `FK_TFC_Orientador` (`orientador`),
  CONSTRAINT `FK_TFC_Grupo` FOREIGN KEY (`idGrupo`) REFERENCES `Grupo` (`id`),
  CONSTRAINT `FK_TFC_Orientador` FOREIGN KEY (`orientador`) REFERENCES `ProfessorDEISI` (`numeroProfessor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
