INSERT INTO `TFC` VALUES (103,'Desenvolvimento de uma API REST (com web tokens)','2019','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de uma API REST (com web tokens) de gestão de uma associação desportiva que visa guardar a assiduidade nos treinos de cada escola associada, pagamentos de cotas (e integração com paypal), marcação de eventos especiais e broadcast de emails para os associados (todos, ou por categoria) com diversas informações.',10,'Atribuido',NULL,'Aluno103','','p5403','a21604600'),(129,'Monitorizacao de dados ambientais','2019','Aceite','','2022-10-07','2022-10-07','Utilização de IOT para monitorização de dados ambientais(Temperatura e humidade).\n1. Utilização de Hardware e software open-source.\n2.  Aplicação móvel para apresentar a informação.\n3. Base de dados para controlo de registos e armazenamentos dos dados da monitorização .',10,'Publicado',NULL,'Aluno129','','p3025','a21502753'),(142,'Plataforma de gestão de eventos v2','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se dar seguimento ao desenvolvimento da componente web da plataforma de gestão de eventos desenvolvida por alunos do ano lectivo anterior. Serão adicionadas funcionalidades como, por exemplo, a edição de dados (membros, eventos), a migração automâtica da base de dados antiga para a nova plataforma. Tentativamente serâ analisada a possibilidade de implementar um sistema de recomendação de eventos.\n\nA orientação deste projecto jâ foi discutida com o Prof. Bruno Cipriano.',10,'Publicado',NULL,'Aluno142','','p4453','a21807154'),(146,'Aplicação móvel para membros de plataforma de gestão de eventos','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação móvel para membros da plataforma de gestão de eventos de uma software house nacional.\n\nEste projecto jâ se encontra em desenvolvimento com o Prof. Rodrigo Correia como orientador e o Prof.  Bruno Cipriano como co-orientador.  ',10,'Publicado',NULL,'Aluno146','','p5653','a21805632'),(157,'Loja Online','2020','Aceite','','2022-10-07','2022-10-07','O objetivo deste trabalho é a construção de uma plataforma de venda de produtos online, com vârias funcionalidades, entre as quais como a possibilidade de pesquisar produtos  e também com um backoffice para realizar a respetiva administração da plataforma.\nEste trabalho seria realizado através de tecnologias como angular para o frontend ; a framework php laravel para o backend ; MySQL como local para guardar os dados',10,'Publicado',NULL,'Aluno157','','p2357','a21006894'),(168,'Ubiquous Quiz Builder','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se dar continuidade ao projecto Android Quiz Builder v2, fazendo desta vez uma aplicação de resposta aos questionârios capaz de correr em vârias plataformas através da tecnologia Flutter e PHP. Este trabalho jâ se encontra a ser orientado pelo Prof. Miguel Tavares e Co-orientado pelo Prof. Bruno Cipriano.',10,'Publicado',NULL,'Aluno168','','p5502','a21807232'),(171,' BoxIt - Plataforma Geradora de Redes de Computadores Virtuais','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se dar continuidade a este trabalho iniciado no ano passado corrigindo e implementando um frontend web para os utilizadores da plataforma. Existem algumas funcionalidades que não foram terminadas ou que têm problemas no backend que também serão alvo de melhoria.\n\nEste trabalho jâ tem orientador atribuído, sendo este o Professor Miguel Tavares.',10,'Publicado',NULL,'Aluno171','','p5502','a21807838'),(174,'The price is right','2020','Aceite','','2022-10-07','2022-10-07','O objetivo é desenvolver uma plataforma, para as pessoas antes de se deslocarem aos supermercados, saberem onde encontrar os produtos com preços mais baratos nos supermercados em seu redor. Os preços serão atualizados pelas pessoas , através de QrCode, leitura das faturas etc. A aplicação irâ comparar e calcularâ qual o melhor supermercado que a pessoa se deve dirigir para poupar dinheiro, através do preço dos produtos bem como o calculo da distância, a pé ou de transportes.',10,'Publicado',NULL,'Aluno174','','p3478','a21700547'),(193,'Plataforma para jogos didâticos destinados a crianças','2020','Recusado','','2022-10-07','2022-10-07','Pretende-se desenvolver uma plataforma para criação e execução de jogos didâticos destinados a crianças (p.e. identificação de objetos,cores,palavras,etc.).\nEste projecto jâ se encontra com o Prof. Bruno Cipriano como orientador.',10,'Recusado',NULL,'Aluno193','Aluno não cumpriu ECTS minimos para inscrição em TFC','p4453','a22006194'),(194,'MyProfHelper','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se desenvolver uma plataforma web auxiliar na avaliação dos alunos. Deverâ ser possível marcar as presenças dos alunos, constituir grupos, criar avaliações de grupo ou individuais. Finalmente, a plataforma deverâ permitir exportar as pautas em vârios formatos como xls, csv ou pdf.\n\nEste trabalho serâ orientado pelo Professor Miguel Tavares',10,'Publicado',NULL,'Aluno194','','p5502','a21700052'),(205,'Assistente de Prognósticos Desportivos','2020','Aceite Com Modificações','','2022-10-07','2022-10-07','Este aplicativo de apoio aos \"Punters\" semi-profissionais, pretende responder a uma maior procura de ferramentas do género no mercado.\nA ideia é automatizar um processo, que consiste num conjunto de modelos preditivos(poisson) que em conjunto com estratégias de gestão de banca e \"follow up\" no estado do mercado indica qual os prognosticos + lucrativos e avisa-nos.\nO mercado das apostas desportivas é + simples que os financeiros normais sendo possível ter retornos > 10% p/ mês. ',10,'Publicado',NULL,'Aluno205','A descrição do tema é pouco claro quanto a funcionalidades e tecnologias a utilizar. Deve ser feito um trabalho de detalhe neste âmbito jâ para a primeira entrega demonstrando que o esforço do TFC é adequado','p3478','a21906962'),(206,'Plataforma de Pontuação para Ginâstica Artística ','2020','Aceite','','2022-10-07','2022-10-07','Plataforma para integrar nas competições de ginâstica Artística permitindo ter um registo dos participantes, juizes, local da prova e entre outras informações que fossem relevantes, com funcionalidade dos juizes terem a capacidade de registar os resultados dos atletas nos diferentes aparelhos em tempo real. A plataforma teria também um modo de apresentação de resultados. Adicionalmente os atletas também poderiam consultar resultados.',10,'Publicado',NULL,'Aluno206','','p2357','a21805677'),(22,'MyCinemaWorld','2018','Recusado','','2022-10-07','2022-10-07','Hoje em dia é bastante perceptível a quantidade de pessoas viciadas no mundo cinematogrâfico. \nProporia-me a realizar uma Plataforma em que o principal objectivo seria cada utilizador manter 1 registo sobre o que foi visualizado e o estado de visualização, assim como teria o objectivo de oferecer uma opinião mais fiel da comunidade sobre o Filme ou Série X ou Y.\nFront End - CSS, BootStrap, Java Script e HTML\nBack End- PHP\nBase de Dados- MySQL\n\n\n',10,'Recusado',1,'Aluno22','NOTA: rejeição com pedido esclarecimento, pode ser submetida novamente\nNão esclarece requisitos, não se percebe se é de registo pessoal ou Social Media\nÉ necessârio maior detalhe\nContactar orientador para validação de orientação e ajuda na proposta','p4453','a21502579'),(220,'Virtual Check-In','2021','Aceite','','2022-10-07','2022-10-07','Criar um website onde seja possível registar e obter informações sobre alojamento. Normalmente sem rececionista. \nCom essa informação serâ gerado um vídeo e enviado ao hóspede, com as indicações de como chegar e entrar, no alojamento, sem necessidade de presença física.\nPretende-se obter os dados das reservas dos sites normalmente conhecidos e utilizados, para personalizar os vídeos.\nE um guia turístico para os hóspedes a quando da entrada no alojamento. ',10,'Publicado',NULL,'Aluno220','','p2703','a20065449'),(228,'Drop-Project para Android','2021','Aceite','','2022-10-07','2022-10-07','O Drop-Project (DP) é uma ferramenta muito utilizada no curso para a realização de exercícios e projetos. Acontece que, o DP econtra-se apenas funcional para projectos Java / Kotlin que depois são mavenized (convertidos para maven). Uma vez que o Android usa o Gradle, torna-o incompatível para este tipo de projetos. O objetivo deste trabalho é fazer com que o DP seja também compativel com o Android, uma vez que seria muito útil para a cadeira de Computação Móvel.\n\nOrientador: Miguel Tavares',10,'Publicado',NULL,'Aluno228','','p5502','a21905661'),(23,'My Medication - Sistema de dispensação e controlo de medicação','2018','Aceite','','2022-10-07','2022-10-07','Sistema de dispensação automâtica de medicamentos, para instituições ou idosos. \n- Gestão e monitorização do sistema por parte dos prestadores de cuidados. \n- Consulta e monitorização por parte dos familiares\n- Utilização de sistema ubíquo móvel para acompanhamento remoto e alarmística.\n\nNota: este trabalho transita do semestre anterior com a concordância do professor orientador Pedro Serra.',10,'Atribuido',NULL,'Aluno23','','p5403','a20086749'),(230,'Drop-Project para Android -App','2021','Aceite','','2022-10-07','2022-10-07','Este projeto tem como objetivo desenvolver uma aplicação Android que ajude nas avaliações dos projetos da disciplina de computação móvel. Permitirâ listar todos os assignments de um projeto Android no DP, compilar esses projetos, instalar as aplicações diretamente, entre outros aspetos.\n\nEste trabalho jâ tem orientador: Miguel Tavares',10,'Publicado',NULL,'Aluno230','','p5502','a21600035'),(244,'UniSpirit- Rede Social Universitâria com o objetivo de melhorar o percurso académico','2021','Aceite','','2022-10-07','2022-10-07','A ideia tem como principal objetivo criar uma ligação de todos os estudantes universitârios podendo proporcionar um melhor aproveitamento ao longo do percurso académico.Através de uma Web App ou APPMobile(ainda por definir)criar uma tecnologia exclusivamente para o universitârio.Ou seja,uma tecnologia que permita ao universitârio combinar encontros de estudo para com outros universitârios criando uma troca de conexoes e conhecimento ,ect.Dentro da app teria: Meets,foruns,blogs,posts,rankings...',77,'Publicado',NULL,'Aluno244','','p2211','a21904946'),(245,'Gestão Propostas de Financiamento Renting','2021','Recusado','','2022-10-07','2022-10-07','Plataforma de gestão  de propostas de financiamento do produto Renting. Back end com gestão dos modelos, dos serviços, dos clientes, das propostas criadas. Inclui tabelas de modelos (viaturas, motas,etc), tabelas de serviços (manutenção, viatura substituição, seguro,etc), base de clientes (part/emp) com relatorios (segmentação, scoring,etc), base de propostas (criação, seguimento,relatorios). Front end com implementação dos componentes visuais e recursos interativos do site. \n',10,'Recusado',NULL,'Aluno245','Não discutido com orientador. Pode ser submetido novamente, mas necessita validação prévia de orientador.','p4997','a21905840'),(252,'Sistema de medicina ocupacional','2021','Aceite','','2022-10-07','2022-10-07','Proponho a criação de um sistema de gestão que visa dar auxílio à medicina do trabalho, permitindo assim ,em função dos riscos que cada empregado estâ exposto, de acordo a sua função e setor na empresa, fazer o controle e acompanhamento de cada um, apresentando de forma grâfica a quantidade de consultas efetuadas, organizando os funcionârios por grupos de doença, exames necessârios para cada função e trabalhador, tipos de risco, riscos que cada setor apresenta, etc. \n',10,'Publicado',NULL,'Aluno252','','p2703','a21504084'),(253,'DEISI ASK (Continuação)','2021','Recusado','','2022-10-07','2022-10-07','Continuação do projeto DEISI ASK.\n- Correção de bugs\n- Implementação de novas funcionalidades (Exportação de dados relativamente â aplicação para os docentes calcularem o nível de desempenho dos alunos; Permitir ao docente criar um tópico \"Informativo\", i.e, não ter comentârios, nem votos (WIKI); Estudo de outras funcionalidades semelhantes ao Jira e ao Confluence; Outras funcionalidades que venham a ser requeridas pelo corpo de docentes)\n- Deploy da aplicação para produção\nCoProf Rui S.',10,'Recusado',NULL,'Aluno253','Proposta não validada por orientador proposto. Pode ser submetida novamente, msa deve ter validação por orientador. Projecto DEISI ASK não tem alterações para justifica rnovo TFC, antecipa-se rejeição se não houver alterções à proposta','p4997','a22003398'),(259,'Aplicação mobile para requisição de livros de uma biblioteca escolar','2021','Aceite','','2022-10-07','2022-10-07','Pretende-se criar uma aplicação android que iria permitir a eficiência na requisição de livros de uma biblioteca escolar, com o intuito em apoiar e fortalecer o projeto pedagógico das escolas. O objetivo é ajudar alunos e professores a encontrem livros sem complicações, em que só precisam inserir o título do livro ou o autor para acessar uma lista de livros relevantes para sua consulta de pesquisa, bem como fazer registros de empréstimos de livros e ser alertado sobre o fim para a devolução.',82,'Publicado',NULL,'Aluno259','','p5653','a21505293'),(26,'Integração RADIUS no contexto do consórcio FCCN / Eduroam','2018','Aceite','','2022-10-07','2022-10-07','Pretende-se implementar um servidor RADIUS de raiz, baseado em \"FreeRadius\" e com todas as condicionantes abrangidas no consorcio da FCCN. \nA autenticação do referido sistema, deverâ utilizar dados a uma \"MS AD 2012 R2\" e, após o tratamento devido de dados, apresentar estatísticas relevantes para posterior anâlise.',10,'Atribuido',NULL,'Aluno26','','p3025','a21502840'),(264,'DEISI236','2021','Recusado','','2022-10-07','2022-10-07','Aplicação Web para estimação de cobertura celular de drones por sistemas de comunicações móveis 4G e 5G. ',10,'Recusado',NULL,'Aluno264','Tema invâlido','p901798','a21902652'),(266,'Site de publicação de conteúdo audiovisual','2021','Aceite','','2022-10-07','2022-10-07','Site para publicação de conteúdo fotogrâfico, havendo possibilidade de submissões externas, que um administrador revê posteriormente, e escolhe publicar ou não consoante a qualidade da submissão.Um dos objetivos do site é uma secção para pequenas entrevistas e/ou vídeos. Um frontEnd que vai estar encarregue de toda a apresentação ao publico geral e um backEnd para tratar das submissões e publicação dos conteúdos. O site tem potencial para expansão havendo possibilidade de abordar outras âreas.',10,'Publicado',NULL,'Aluno266','','p2357','a21805677'),(27,'MyCinemaWorld','2018','Aceite Com Modificações','','2022-10-07','2022-10-07','Plataforma comunitâria com registo pessoal ligado ao mundo cinematogrâfico. O site possuiria um top de séries e filmes baseado no rating de users comuns, assim como uma \"aba\" de recentes.\nCada user poderia por exemplo visualizar informações referentes ao filme, adicionar um estado de visualização, escrever uma review e sugestão, avaliar(0-10), recomendar a outros users ou até mesmo adicionar aos favoritos.\nFront End - CSS, BootStrap, Java Script e HTML\nBack End- PHP\nBase de Dados- MySQL\n',10,'Atribuido',1,'Aluno27','Alteração de orientador para mais ajuste à tecnologia ','p5404','a21502579'),(312,'Site Trampolins Clube de Leiria','2022','Recusado','','2022-10-07','2022-10-07','Pretendo fazer o site do clube onde o meu filho pratica ginâstica de trampolins, em Leiria. \nTerâ conteúdo e Informação disponível para consulta dos utilizadores.\nPermitir inserir dados para inscrição de ginastas.\nImplementar uma ârea reservada para planificação de treinos adaptada â realidade do clube.\nImpressão dos treinos em PDF por atleta.\nLista de ginasta por escalões.  \n',94,'Recusado',NULL,'Aluno312','Trabalho não validado pelo orientador proposto\no Tema pode ser submetido novamente indicando novo orientador, mas deve-se obter a aprovação do mesmo antes de propor ','p6069','a20065449'),(323,'WebApp em Django ','2022','Aceite','','2022-10-07','2022-10-07','Realização de uma aplicação web em Django dedicada a uma  empresa de serralharia com o objectivo de facilitar o processo de encomenda de produtos e gestão de orçamentos, onde o cliente poderia modelar os seus produtos verificar catâlogos e fazer pedidos de orçamentos e onde a empresa podia alterar catâlogos, entrar em contacto com cliente, verificar as encomendas, gerir os orçamentos entre outras funcionalidades ainda por discutir.',10,'Publicado',NULL,'Aluno323','','p2703','a21502898'),(332,'Sensores de Temperatura para HACCP','2022','Aceite','','2022-10-07','2022-10-07','Tem como objetivo o registo de temperaturas obrigatórias das  para o HACCP de forma automatizada.\nO registo serâ feito e medido com sensores de Arduino e guardados numa base de dados.\nA sua consulta serâ feita através de uma pâgina web. \nO sistema deverâ permitir enviar alertas caso haja, por exemplo, temperaturas fora dos parâmetros definidos.\n ',10,'Publicado',NULL,'Aluno332','','p1059','a20065449'),(342,'Projeto de Machine Learning','2022','Recusado','','2022-10-07','2022-10-07','Projeto no âmbito de Data Science (com foco em Machine Learning) ainda por definir entre empresa e universidade.',103,'Recusado',NULL,'Aluno342','Tem que existir contexto, tema ou orientador, de outra forma não é possível avaliar o esforço esperado para TFC','p2703','a21906962'),(344,'Analise de dados sobre a criminalidade em lisboa','2022','Recusado','','2022-10-07','2022-10-07','Eu gostaria de desenvolver um projeto onde conseguisse analisar a criminalidade na regiao de lisboa, sabendo a que horas e em que zonas, os diferentes tipos de crimes são cometidos.',10,'Recusado',NULL,'Aluno344','Tema interessante, mas não tem fundamentação suficiente para ser aceite. Não são indicadas tecnologias, abordagem ao problema nem referência a fontes para dados. É necessârio demonstrar viabilidade ou indicar orientador/entidade externa que a suportem','p2703','a22103831'),(47,'Sistema de ticketing (pedidos de assistência) para a empresa Rodoviâria de Lisboa','2018','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de uma plataforma para gestão de tickets, relativos a pedidos de suporte da ârea de IT, constituída por uma aplicação móvel e uma aplicação web que comuniquem entre si. Os pedidos criados são reencaminhados para os responsâveis das âreas e um dos elementos da equipa de IT aloca-se ao pedido. Todo o histórico e evolução dos pedidos estariam disponíveis para consulta. Deverâ ter uma componente para gerar relatórios de tipo de pedidos, tempo médio de resposta, entre outros.',21,'Atribuido',NULL,'Aluno47','','p4453','a21601155'),(48,'OFiOCoN','2018','Recusado','','2022-10-07','2022-10-07','Aplicação Colaborativa de Produtos Biológicos\n',10,'Recusado',NULL,'Aluno48','A proposta não descreve adequadamente o TFC. \nFica o convite para que seja submetida novamente com identificação de âmbito, descrição resumida de trabalho a realizar, resultados esperados e tecnologia a utilizar. ','p3478','a21404687'),(49,'Gestor de dívidas para controlo interno','2018','Recusado','','2022-10-07','2022-10-07','Este protejo tem como objectivo agilizar/automatizar o processo de abate de dividas de cada consultor da empresa.  Com isto a empresa pretende ter uma webapp personalizada/costumizada ,feita de raiz seguindo os requisitos da empresa , onde todo o processo de gestão é controlado na mesma.  A recolha de dados da situação financeira é feita através do acesso a uma base dados. Para validar qualquer alteração nos valores em divida deverâ ser feito upload dos devidos comprovativos.',22,'Recusado',10,'Aluno49','a substituir por proposta de empresa','p4453','a21700075'),(57,'Algoritmos genéticos aplicados aos video jogos.','2018','Aceite','','2022-10-07','2022-10-07',' Com este TFC pretendemos pegar num jogo tower defence estilo \"Plants vs Zombies\" e aplicar um algoritmo genético com o objectivo de desenvolver uma Inteligência artificial e ver até onde a inteligência desse algoritmo pode chegar. Para atingirmos esse objectivo a ideia é ter dois ambientes de jogo , um para o utilizador e outro para a maquina, em que os inputs do utilizador serão guardados e tratados pelo algoritmo genético para posteriormente fornecer a informação à  maquina.',10,'Atribuido',14,'Aluno57','','p5354','a21700924'),(59,'Simulador de Comparador de Cursos','2018','Recusado','','2022-10-07','2022-10-07','Pretende-se criar um programa que compare (através das disciplinas, médias, número de cadeiras pràticas vs. cadeiras teóricas, etc.) cursos dentro de uma Universidade e que devolva uma lista de cursos consoante as preferências dos utilizadores. Destinado a futuros candidatos à  Universidade. ',10,'Recusado',17,'Aluno59','O preponente do tema jâ tem trabalho atribuido','p2703','a21507835'),(60,'Gestão de Condomínios e Anâlise de Tarefas','2018','Recusado','','2022-10-07','2022-10-07','Pretende-se criar uma plataforma de gestão de condomínios, incluindo estatutos dos condóminos.\nGerar actas e recibos pagamento.\nAnalise de actas, de obras, gestão de conta bancâria, conteúdos da legislação patente nos condomínios e manutenção das âreas envolventes.\nPrevisão de alterações a longo prazo que englobem os condonimos, obras.\nGestão de litigios, e faltas de pagamento, apoio júridico.\n\n\n',10,'Recusado',17,'Aluno60','Grupo jâ tem trabalho atribuído (DEISI41 - Gestão de portfólio aplicacional )','p2703','a21507835'),(62,'Controlo Aéreo','2018','Recusado','','2022-10-07','2022-10-07','A proposta para o nosso TFC consiste na criação de um sistema com Inteligência Artificial que irâ analisar todas as decisões tomadas pelos controladores aéreos num determinado aeroporto. O sistema verificarâ o risco associado a cada decisão e irâ intervir caso seja necessârio. Irâ também ser criada uma DB onde serâ guardada toda a informação dos aviões nesse dado aeroporto. Além disso, serâ criado um radar que mostre o percurso dos aviões consoante as decisões tomadas.',10,'Recusado',20,'Aluno62','Tema substituido','p5265','a21603256'),(63,'API de Gestão de Associação Desportiva','2018','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de uma API REST (com web tokens) de gestão de uma associação desportiva que visa guardar a assiduidade nos treinos de cada escola associada, pagamentos de cotas (e integração com paypal), marcação de eventos especiais e broadcast de emails para os associados (todos, ou por categoria) com diversas informações.',10,'Atribuido',NULL,'Aluno63','','p5403','a21604600'),(67,'Route Planner','2018','Aceite','','2022-10-07','2022-10-07','Consiste em criar uma plataforma onde pode-se colocar um ponto de origem e um destino e a plataforma calcula opções de locomoção para o trajeto indicado, podendo ter em conta restrições e/ou preferências dos utilizadores (ex: não quer andar de comboio). A ideia é que a plataforma comunique com uma base de dados (CRUD) por meio de web services para poder obter a informação necessâria acerca dos meios de transporte disponíveis. A ideia jâ foi discutida com o professor Bruno Cipriano que aceitou-a.',10,'Atribuido',22,'Aluno67','','p4453','a21800835'),(69,'Spotter','2018','Recusado','','2022-10-07','2022-10-07','Spotter é uma aplicação que visa gerir uma comunidade de utilizadores e locais de interesse não turísticos/conhecidos. Estes são locais com uma vista, paisagem ou locais relevantes que, fundamentalmente, tenham algum interesse e não representem diretamente negócios, monstrando assim locais alternativos a quem estejas disposto a visita-los normalmente pouco divulgados e apenas conhecidos apenas por locais, sendo assim locais mais \"niche\" e de pouco movimento.',10,'Recusado',24,'Aluno69','proposta com erro de forma: submetida por grupo mas só identifica 1 aluno; tema e descrição submetido anteriormente a titulo individual por outro aluno.\nPrazo de proposta de aluno terminado, reformulação terâ que ser submetida por orientador\n','p4453','a21502583'),(82,'Plataforma de Apoio a Projetos de Multiplos Clientes','2019','Aceite','','2022-10-07','2022-10-07','A ideia deste trabalho é auxiliar os alunos no desenvolvimento de projetos que envolvam multiplos clientes e ou servidores. Nos dias de hoje, os alunos são obrigados a usar mâquinas virtuais para o efeito, no entanto, nem sempre os alunos têm hardware para lançar multiplas instancias do virtualbox. Uma vez que o docker consome consideravalmente menos recursos, neste trabalho pretende-se criar uma plataforma que abstraia a criação de dockers de forma dinâmica consoante as necessidades.',10,'Publicado',NULL,'Aluno82','','p5502','a21705328'),(87,'Digital Badges in Education','2019','Aceite','','2022-10-07','2022-10-07','Através deste trabalho pretende-se desenvolver um sistema de badges digitais, em que o objetivo principal proposto para o projeto é construir uma plataforma onde  seja possível  desenvolver, validar e reconhecer as competências de cada aluno. Este sistema serâ testado com vârias disciplinas das licenciaturas do DEISI.\nEste TFC jâ se encontra em curso.\n',10,'Publicado',NULL,'Aluno87','','p4997','a21703957'),(88,'Plugin DP para IntelliJ','2019','Aceite','','2022-10-07','2022-10-07','Pretende-se criar um plugin para o IDE IntelliJ cujo objectivo principal é automatizar o processo de submissões para a plataforma Drop-Project. Para além disso, serão estudadas/implementadas componentes de apoio ao ensino, também baseadas em interacções entre o IntelliJ e o DP, como por exemplo o calculo de estatísticas e o \"download\" automâtico de projetos para a mâquina do Professor. Este sistema serâ testado durante este ano lectivo em LP2 e/ou AED.\nO trabalho jâ se encontra em curso.',10,'Publicado',NULL,'Aluno88','','p4453','a21705201'),(94,'Android Quiz Builder v2','2019','Aceite','','2022-10-07','2022-10-07','Introdução de elementos de jogo na aplicação Android Quiz Builder. Serão introduzidos novos tipos de questionârio, para suportar jogos do estilo \"Quem quer ser milionârio?\".\nEste projecto serâ a continuação de um TFC realizado em ano lectivo anterior.',10,'Publicado',NULL,'Aluno94','','p4453','a21702482'),(1,'Plataforma DEISI - Gestão de TFCs','2018','','','2022-10-07','2022-10-07','Continuar o trabalho jâ desenvolvido na plataforma de gestão de TFCs para incluir novas funcionalidades: upload dos relatórios e outros artefactos; agendamento das apresentações intermédias e finais; registo das avaliações intermédias e finais; notificações; etc. A aplicação foi desenvolvida em Java usando a framework Spring. O objectivo é integrar as novas funcionalidades jâ no próximo semestre. Este trabalho é para ser desenvolvido por um aluno.',NULL,'Atribuido',NULL,'DEISI1','','p4997','p4997'),(10,'Context-aware recommender systems in collaborative network of organizations','2018','','','2022-10-07','2022-10-07','Desenvolver as funcionalidades necessârias para pesquisar informações em Redes Colaborativas de Organizações. Os recursos incluem gestão de ontologia, anotação semântica automâtica, indexação de documentos e pesquisa semântica baseada em contexto. Ferramentas existentes serão usadas para a implementação da perspectiva semântica; criando novos métodos, estratégias, APIs, modelos e anâlise dos processos sociotécnicos de colaboração.',1,'Indisponivel',NULL,'DEISI10','','p3478','p3478'),(100,'Gestão de negócios internacionais','2019','','','2022-10-07','2022-10-07','Plataforma digital onde desenvolve-se um conjunto de ferramentas que permitam gerir projetos em diversos mercados internacionais, gerir projetos de empreendedores e divulgar o próprio projeto, junto de empresas, empreendedores e investidores, e outros stakeholders. Gestão de participantes em mercados e projetos, um BackOffice, com um conjunto de interfaces que permitam a inscrição de empresas, mas também a de potenciais empreendedores que pretendam recorrer aos serviços.',36,'Publicado',NULL,'DEISI100','','p3478','p3478'),(101,'Framework para Rede Colaborativa de Organizações','2019','','','2022-10-07','2022-10-07','As redes não só ajudam os agentes a atingir massa crítica e económica de escala, mas também a abranger mercados maiores e mais diversificados, o que não aconteceria se os mesmos agentes trabalhassem isolados. Aplicando e estendendo um framework para redes colaborativas de organizações pretende-se criar redes fortes e motivar a inovação, assim, é proposto a articulação de uma rede de atores empresariais.',37,'Publicado',NULL,'DEISI101','','p3478','p3478'),(102,'Agregador multitemâtico','2019','','','2022-10-07','2022-10-07','Portal social, com pesquisa natural, semântica, adaptativo a cada utilizador, agregador multitemâtico de publicações de blogs, portais e outros recursos. As plataformas (web, mobile ou desktop), tecnologias e as funcionalidades deverão ser definidos juntamente com o orientador.',38,'Publicado',NULL,'DEISI102','','p3478','p3478'),(105,'Geração automâtica de horârios','2019','','','2022-10-07','2022-10-07','Pretende-se com este trabalho o desenvolvimento de uma aplicação web, em que funcionârios dos recursos humanos poderiam utilizar para introduzirem prioridades e informações sobre qual a unidade curricular, número de horas, disponibilidades dos docentes, turmas, para que esta sozinha fizesse a atribuição de salas e gerar os horârios das turmas.\n',NULL,'Publicado',NULL,'DEISI105','','p5932','p5932'),(11,'App de farmâcia com apoio de especialista','2018','','','2022-10-07','2022-10-07','desenvolvimento de aplicação web de farmâcia pessoal com funcionalidade de contacto a especialistas',NULL,'Atribuido',NULL,'DEISI11','','p3478','p3478'),(111,'Anâlise automâtica de conversas em redes sociais.','2019','','','2022-10-07','2022-10-07','O objetivo desta tese e coletar dados de conversas em redes sociais, particularmente do Twitter e de situações experimentais controladas, para utilizar técnicas de inteligência artificial e \'machine learning\' para identificar conceitos chave. Uma vez identificados estes conceitos chave vamos analizar as suas dinâmica complexas no tempo para tentar identificar vulnerabilidades sociais, ideias que tem alta ressonância e capacidade viral, etc. ',NULL,'Publicado',NULL,'DEISI111','','p5265','p5265'),(12,'Rede colaborativa inter-organizacional de agricultura biológica','2018','','','2022-10-07','2022-10-07','Ajudar os agentes a atingir massa crítica e económica de escala, mas também a abranger mercados maiores e mais diversificados, através de redes colaborativas de organizações pretende-se criar redes fortes e motivar a inovação, aplicado na articulação de uma rede de atores de agricultura biológica',4,'Atribuido',NULL,'DEISI12','','p3478','p3478'),(122,'Aplicação de gestão de condomínio usando Python e Django','2019','','','2022-10-07','2022-10-07','A linguagem Python é um sucesso de popularidade. A plataforma Django permite desenvolver em Python para a Web.\nPretende-se desenvolver um site de gestão de condomínios usando esta tecnologia, interagindo com uma base da dados MySQL.\nAs especificações do site serão fornecidas pela professor, pelo que o(s) aluno(s) terão que se concentrar no estudo da linguagem e na utilização da plataforma para o desenvolvimento Web.',NULL,'Publicado',NULL,'DEISI122','','p2357','p2357'),(123,'Aplicação de gestão de condomínio usando PHP','2019','','','2022-10-07','2022-10-07','A linguagem PHP permite disponibilizar sites hospedados na nuvem de forma barata.\nPretendemos desenvolver uma aplicação WEB usando linguagem PHP e base dados MySQL, sem recorrer a frameworks para garantir controlo total do código.\nAs especificações do site serão fornecidas pela professor, assim como os templates de código, que depois serão usados para implementar todas as funcionalidades.',NULL,'Publicado',NULL,'DEISI123','','p2357','p2357'),(124,'Aplicação WEB para gestão de inventârio de assets informâticos','2019','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação WEB que permita inventariar \"assets\" usados num departamento de informâtica. Por \"assets\" entendemos computadores, routers, switchs, redes, salas técnicas, etc, etc.\nOs \"assets\" têm relações hierârquicas entre si, que variam de cliente para cliente, pelo que o grande desafio estâ no modelo de dados e na interface grâfica.\nA solução técnica poderâ assentar em Java, PHP ou Python',NULL,'Publicado',NULL,'DEISI124','','p2357','p2357'),(125,'Aplicação de Gestão Portfolio Aplicacional','2019','','','2022-10-07','2022-10-07','O objetivo deste trabalho é continuar o desenvolvimento de uma aplicação de Gestão de Portfólio Aplicacional, complementando a oferta comercial existente, que permita fazer o registo e controlo das aplicações em utilização, em implementação e planeadas, definir métricas para classificar as mesmas.\nDeverâ ser permitido tipificar os perfis de utilizadores e definir as aplicações que cada perfil necessita.\nDeverão ser disponibilizados alertas e relatórios agregados pelas métricas implementadas.',NULL,'Publicado',NULL,'DEISI125','','p2','p2'),(126,'Aplicação de Gestão de Arquitetura Empresarial, Projetos e Portfólio Aplicacional.','2019','','','2022-10-07','2022-10-07','Pretende-se com este trabalho desenvolver uma aplicação que permita controlar e relacionar as ações resultantes de um projeto de arquitetura empresarial, dos projetos em curso e do portfólio aplicacional.',NULL,'A Aguardar Atribuição',NULL,'DEISI126','','p2','p2'),(127,'Elaboração da Arquitetura Empresarial (Sistemas de Informação) para uma empresa baseada no Framework de Zachman','2019','','','2022-10-07','2022-10-07','Pretende-se com este trabalho efetuar um projeto de arquitetura empresarial de uma empresa utilizando como referência a Framework de Zachman e utilizando uma ferramenta de modelação de processos, preferencialmente o Powerdesigner 16.0 ou posterior. Deverão ser identificadas âreas de melhoria e ações a desenvolver (Plano de ação).               ',43,'A Aguardar Atribuição',NULL,'DEISI127','','p2','p2'),(128,'Desenvolvimento de funcionalidades para o middleware UbiPri','2019','','','2022-10-07','2022-10-07','Recentemente, a Internet of Things (IoT) tem verificado um crescimento muito râpido, com cada vez mais dispositivos do quotidiano ligados à Internet. Desta forma, torna-se importante estudar novos métodos de proteger os dados e privacidade dos utilizadores, tendo em conta que dispositivos IoT têm limitações a nível do poder computacional e de consumo energético, pelo que pode tornar difícil a implementação de soluções robustas que garantam a privacidade dos dados dos utilizadores.\n',NULL,'A Aguardar Aprovação',NULL,'DEISI128','','p5905','p5905'),(13,'Portal Empresarial','2018','','','2022-10-07','2022-10-07','Plataforma digital onde desenvolve-se um conjunto de ferramentas que permitam gerir projetos em diversos mercados internacionais, gerir projetos de empreendedores e divulgar o próprio projeto, junto de empresas, empreendedores e investidores, e outros stakeholders. Plataforma de inscrições e gestão de participantes em mercados e projetos, com um conjunto de interfaces que permitam a inscrição de empresas, mas também a de potenciais empreendedores que pretendam recorrer aos serviços do projeto.\n',4,'Atribuido',NULL,'DEISI13','','p3478','p3478'),(130,'LogiSim melhorado - Versão Lusófona','2019','','','2022-10-07','2022-10-07','Neste TFC, o objetivo é usar o LogiSim como partida para desenvolver um simulador feito à medida dos conteúdos programâticos de SD e AC dos cursos da ECATI.\nOs trabalhos a efetuar são:Dominio da geração do simulador a partir do código fonte existente;Introdução de características inovadoras/reparação de bugs existentes:Desenvolvimento de bibliotecas específicas para SD e AC;\nOs requisitos para este TFC são:\na) Domínio da programação JAVA + Grâficos.\nb) Média das notas de SD e AC mín de 14V.',NULL,'A Aguardar Atribuição',NULL,'DEISI130','','p1059','p1059'),(132,'Machine Learning para deteção de fraude online de cartões bancârios','2019','Aceite','','2022-10-07','2022-10-07','Este trabalho tem como objetivo auxiliar a deteção de fraudes bancârias, de forma a reduzir o prejuízo de empresas que possam ser afetadas. Para isso, explora-se e aplica-se o conceito de Machine Learning, para se conseguir fazer uma deteção em tempo real de uma possível fraude, durante uma transação online',NULL,'Publicado',NULL,'DEISI132','','p5963','p2703'),(133,'REST API Associação Portuguesa de Hapkido Yang Hum Kwan','2019','Aceite','','2022-10-07','2022-10-07','Este Trabalho Final de Curso (TFC) enquadra-se num requerimento de umaassociação sem fins lucrativos de Artes Marciais, a Associação Portuguesa de HapkidoYang Hum Kwan, que pretende uma plataforma de gestão geral, como horârios e eventos,pagamentos de quotas e matéria lecionada em cada uma das escolas das variadas Artes',44,'Publicado',NULL,'DEISI133','','p5403','p2703'),(134,'Sistema de Avaliação de Desempenho','2019','Aceite','','2022-10-07','2022-10-07','Este projeto serâ utilizado para a vertente dos Recursos Humanos, de uma instituição, onde se irâ integrar o Sistema de Avaliação de Desempenhos de forma a que cada utilizador presente no sistema ERP-GHR consiga ser avaliado e autoavaliado.A aplicação a ser desenvolvida serâ uma extensão do sistema ERP de Recursos Humanos jâ existente, sendo esta um motor de inquéritos personalizado',NULL,'Publicado',NULL,'DEISI134','','p2703','p2703'),(135,'App4SHM - Aplicação móvel para anâlise estrutural','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação móvel que consiga medir a integridade de uma estrutura (ex: ponte) através de leituras do acelerómetro e posterior processamento desses dados recorrendo a algoritmos de machine learning. Os algoritmos poderão ser executados no próprio dispositivo ou num servidor com o qual o dispositivo comunica. Este trabalho estâ inserido num projecto de investigação do Departamento de Engenharia Civil.\nNota: Este TFC jâ estâ atribuído.',45,'Publicado',NULL,'DEISI135','','p4997','p4997'),(136,'Vacqa Mobile - Auxílio ao diagnóstico de medicina veterinâria','2020','','','2022-10-07','2022-10-07','A aplicação vacqa é uma aplicação muito popular de assessoria à exploração de bovinos desenvolvida por um professor do departamento de medicina veterinâria. Pretende-se desenvolver a mesma aplicação em ambiente móvel que permita aos veterinârios fazerem o seu diagnóstico diretamente no telemóvel ou tablet, através do preenchimento de dados e captura de fotos.\nEste trabalho é desenvolvido em parceria com o Departamento de Medicina Veterinâria.',46,'Publicado',NULL,'DEISI136','','p4997','p4997'),(137,'Plataforma de inquéritos aos alunos','2020','','','2022-10-07','2022-10-07','Os inquéritos de satisfação aos alunos do DEISI têm sido um sucesso mas dependem de um serviço externo (responster) com reduzida flexibilidade e interoperabilidade. Pretende-se desenvolver uma solução alternativa que mantenha todas as garantias de anonimato e a qualidade da interface grâfica em dispositivos móveis mas que permita maior interoperabilidade com os sistemas existentes. Caso tenha sucesso, passarâ a ser a plataforma oficial para os referidos inquéritos.\nNota: TFC jâ atribuído.',NULL,'Publicado',NULL,'DEISI137','','p4997','p4997'),(138,'Gestão de centros de investigação','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação web com a responsabilidade de gerir toda a informação dos investigadores de um centro de investigação: equipa de investigadores, atividades desenvolvidas, publicações, etc. A aplicação deverâ ser capaz de produzir diversos relatórios com base nesta informação. Este desenvolvimento serâ integrado num projecto do \nCeiED (Centro de Estudos Interdisciplinares em Educação e Desenvolvimento), mas pretende-se que seja alargado a outros centros no futuro.',47,'Publicado',NULL,'DEISI138','','p4997','p4997'),(139,'Home Surveilance Kit baseado em Raspberry Pi','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver um sistema doméstico de videovigilância utilizando Raspberry Pi e os seu componentes\nO sistema serâ composto por 3 componente: microcâmeras, armazenamento local e site para visualização de imagens. O sistema deverâ permitir live feed e consulta de gravações\nEm adição, o sistema deverâ implementar solução avançadas, ex.: detecção de movimento, reconhecimento de objectos ou outros\nHardware disponibilizado',NULL,'Publicado',NULL,'DEISI139','','p2703','p2703'),(14,'Blockchain Incubation As a Service','2018','','','2022-10-07','2022-10-07','Blockchain Incubation As a Service (IAAS) - Use our AI Center for your work Industry Solutions (e.g. letter of credit, loyalty management, energy trading etc.). Initial Coin Offer Solutions.',1,'Indisponivel',NULL,'DEISI14','','p3478','p3478'),(140,'fechadura inteligente','2020','','','2022-10-07','2022-10-07','Desenvolvimento de fechadura digital inteligente com segurança avançada e confirmação em 2 passos. \nProjecto desenvolvido em Raspbery Pi (fechadura) e Android (chave) \nPode assumir vârios formato, a concretizar na primeira faze do TFC, que poderão ir desde uso de credenciais integradas com sistemas empresarias à geração dinâmica de PIN (fechadura gera QR lido pelo Android, que gera PIN a inserir pelo utilizador na fechadura)\nContinua TFC de anos anteriores\nHardware disponibilizado',NULL,'Publicado',NULL,'DEISI140','','p2703','p2703'),(141,'Plataforma de subscrição de serviços','2020','','','2022-10-07','2022-10-07','Construção de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrição de serviços, disponibilizados em formato de partilha de tempo e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes. \nPara este ano lectivo o objectivo é desenvolver a plataforma de publicação e subscrição de serviços, segundo as especificações do modelo conceptual produzido em TFC anterior',NULL,'Publicado',NULL,'DEISI141','','p2703','p2703'),(143,'Aplicação de anâlise e priorização de requisitos','2020','','','2022-10-07','2022-10-07','Numa empresa são perdidas muitas horas no processo de decisão de quais os requisitos a implementar. É fundamental otimizar recursos e ganhos.\nO objectivo deste trabalho é desenvolver uma aplicação que normaliza e avalie a qualidade dos requisitos, face a normas gerais de anâlise e especificação de requisitos e internas de uma empresa e que os classifique e lhes atribua prioridades, para facilitar o processo de decisão.\nDeve também ser feita uma anâlise da situação atual da oferta de mercado.\n',NULL,'Publicado',NULL,'DEISI143','','p2','p2'),(144,'Aplicação de anâlise de qualidade de software.','2020','','','2022-10-07','2022-10-07','Muitas aplicações específicas desenvolvidas, nunca chegam a ser utilizadas e  quando existe necessidade de fazer alteração das mesmas, quem fez o desenvolvimento jâ não se encontra na empresa.\nPretende-se com este trabalho desenvolver uma aplicação que permita, com base nos requisitos e em normas realizar a anâlise e qualidade do software, como parte integrante do processo de aceitação e entrada em produção do mesmo.\nDeve também ser feita uma anâlise da situação atual da oferta de mercado.',NULL,'Publicado',NULL,'DEISI144','','p2','p2'),(145,'Aplicação de geração de testes a software','2020','','','2022-10-07','2022-10-07','Para que uma aplicação cumpra os objectivos para os quais foi implementada é fundamental assegurar que ela satisfaz as necessidades e requisitos definidos.\nPor outro lado cada vez que se verificam actualizações ou adição de requisitos, é fundamental garantir que para além das novas funcionalidades, também as anteriores continuam a funcionar.\nPretende-se com base em Use Cases desenvolver uma aplicação que gere (e opcionalmente execute) testes de aceitação e conformidade da aplicação.',NULL,'Publicado',NULL,'DEISI145','','p2','p2'),(149,'Traveller\'s community','2020','','','2022-10-07','2022-10-07','Objetivo do TFC consiste no desenvolvimento de uma aplicação mobile cujo alvo são as pessoas que gostam de viajar e necessitam de uma ajuda a conhecer novos locais, rotas de viagens interessantes, conhecer novas pessoas durante a viagem, novos costumes locais, etc.\n',NULL,'Publicado',NULL,'DEISI149','','p5932','p5932'),(15,'Multilingual chatbots','2018','','','2022-10-07','2022-10-07','Multi-Languages Bots (NLP) Chatbots by using Google Dialog Flow, Microsoft Azure, IBM Platforms.\nOrder bot (Automated your Order process), HR Bot, Banking Bot, Help Desk Bot.',1,'Indisponivel',NULL,'DEISI15','','p3478','p3478'),(152,'Plataforma MentHA: gamification do treino cognitivo e avaliação neuropsicológica','2020','','','2022-10-07','2022-10-07','Desenvolver uma plataforma web de gamification que implemente o programa de estimulação cognitiva Mental Health and Aging (shorturl.at/dCUW1), através de jogos, tarefas e quizz multimédia que incidam sobre a funcionalidade cognitiva e social dirigido a pessoas que apresentam comprometimento neuropsicológico e/ou demência. Serâ também implementado um protocolo de avaliação neuropsicológica dos pacientes, permitindo gerir, aplicar e visualizar avaliações destes. lucio.studer@ulusofona.pt',60,'Publicado',NULL,'DEISI152','','p6069','p6069'),(154,'Aplicação para a monitorização e controlo de Drones','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação móvel que consiga monitorizar drones em qualquer ponto geogrâfico e ao mesmo tempo ser possível controlâ-los. Este trabalho insere-se em parceria com uma empresa portuguesa.',NULL,'Publicado',NULL,'DEISI154','','p6115','p6115'),(155,'Aplicação para a monitorização de missões para Drones','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação móvel que consiga criar/editar/enviar/receber missões para drones em qualquer ponto geogrâfico e ao mesmo tempo ser possível monitorizâ-los. Este trabalho insere-se em parceria com uma empresa portuguesa.',NULL,'Publicado',NULL,'DEISI155','','p6115','p6115'),(158,'Plataforma de Gestão de Identidades e Acessos','2020','','','2022-10-07','2022-10-07','Continuidade de protótipo de plataforma de Gestão de Identidades e Acessos, baseado em Open Source, com anâlise de vantagens e desvantagens entre OpenIAM, Shibboleth, WSO2 Identity Server, MidPoint, Soffid, Apache Syncope, Gluu.\nObjetivo demonstrar integração e controlo de acessos  com um CRM, um Active Directory, um Gestor de Conteúdos, etc.',52,'Publicado',NULL,'DEISI158','','p3113','p3113'),(159,'Content Marketplace platform','2020','','','2022-10-07','2022-10-07','Lançamento de Prototipo desenvolvido em TFCs de anos anteriores (2019 - anâlise de requisitos; 2020 - prototipagem) de plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. Funcionalidades futuras: disseminar conteúdo de redes sociais ser aprovado, disseminar diretamente em vârias redes sociais.',11,'Publicado',NULL,'DEISI159','','p3113','p3113'),(16,'Deep Learning','2018','','','2022-10-07','2022-10-07','Bring AI to your Business. Make your Processes Smarter. Major Industry platforms for Deep learning including IBM Watson, Microsoft Azure, Google.ai & Open Source...',1,'Indisponivel',NULL,'DEISI16','','p3478','p3478'),(160,'Buddy abroad ','2020','','','2022-10-07','2022-10-07','Fusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',53,'Publicado',NULL,'DEISI160','','p3113','p3113'),(161,'Plataforma de Informação Geogrâfica para a CM Lisboa','2020','','','2022-10-07','2022-10-07','Baseada em tecnologia líder mundial de informação geogrâfica - ESRI.\nDesenvolvimento de plataforma mobile de levantamento de estâtuas para a CM Lisboa e de plataforma Web de visualização e anâlise via dashboards  (similar a Google Maps).',54,'Publicado',NULL,'DEISI161','','p3113','p3113'),(162,'Plataforma de Monitorização de Impressoras 3D de Construção de Casas','2020','','','2022-10-07','2022-10-07','Desenvolvimento de plataforma de sensores a instalar em Impressoras 3D de construção civil. Este projeto tem vârios módulos, entre os quais o desenvolvimento de sensores (eventualmente baseados em Arduino/Raspberry), componente de comunicações de IoT com sistema central e plataforma analítica e alarmistica de dados.',55,'A Aguardar Atribuição',NULL,'DEISI162','','p3113','p3113'),(163,'Portal Empresarial de Conteúdos e CRM Integrado','2020','','','2022-10-07','2022-10-07','Desenvolvimento de Plataforma de Conteúdos para empresa em WordPress, com integração de Módulo de Gestão de Clientes OpenSource (a definir entre SuiteCRM e Odoo) e de Marketing (extensão e integração com Mailchimp).',32,'Publicado',NULL,'DEISI163','','p3113','p3113'),(164,'Aprendizagem baseada em jogos e recursos educacionais abertos','2020','','','2022-10-07','2022-10-07','Aprendizagem baseada em jogos, recursos digitais multimédia e/ou recursos educacionais abertos. Pretende-se explorar a conceção e desenvolvimento de jogos, para a aprendizagem ao longo da vida, formação profissional ou em contexto das redes colaborativas. O tema, plataforma (web, mobile), tecnologias e as funcionalidades dos jogos/ recursos deverão ser definidos juntamente com o orientador.',NULL,'Publicado',NULL,'DEISI164','','p3478','p3478'),(165,'Desenvolvimento, publicação e distribuição online de jogos sérios','2020','','','2022-10-07','2022-10-07','Site de alojamento de jogos sérios (https://pt.wikipedia.org/wiki/Serious_game), permite desenvolver, publicar e distribuir jogos sérios em plataformas móveis, sociais e online.',NULL,'A Aguardar Atribuição',NULL,'DEISI165','','p3478','p3478'),(166,'Tecnologias de certificação e qualificação','2020','','','2022-10-07','2022-10-07','Propõe-se criar funcionalidades para certificação e qualificação, através de aplicação e desenvolvimento de modelos de negócio B2B/ B2C, tecnologias de eLearning aplicadas: SCORM, Badges, etc..',NULL,'A Aguardar Atribuição',NULL,'DEISI166','','p3478','p3478'),(167,'Conteúdos de aprendizagem colaborativos','2020','','','2022-10-07','2022-10-07','Criação de uma rede colaborativa para utilização de entidades, professores e formadores, que permita construir e reconstruir automaticamente, semi-autmaticamente ou manualmente, conteúdos de aprendizagem formais e não-formais. Plataforma permite construir, reconstruir e reutilizar conteúdos colaborativamente em diversos contextos.',NULL,'Publicado',NULL,'DEISI167','','p3478','p3478'),(17,'Plataforma Gestão de Requisitos','2018','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação de gestão de ciclo de vida de requisitos utilizando abordagens SCRUM e AGSI-Arquitectura da Gestão de Sistemas de Informação e descrição de requisitos em template a fornecer por orientador\nTrabalho enquadra-se em projecto mais amplo, visando a integração com ferramentas de gestão de projecto (e.g.: VSTS, MS-Project, projectlibre, etc.) e de controlo de versões (e.g.: git) \nDisciplinas listadas não são de obrigatoriedade cumulativa',NULL,'Atribuido',NULL,'DEISI17','','p2703','p2703'),(170,'Classificador de géneros musicais','2020','','','2022-10-07','2022-10-07','Pretende-se criar um classificador automâtico/ semi-automâtico de géneros/ sub-géneros musicais lusófonos',NULL,'Publicado',NULL,'DEISI170','','p3478','p3478'),(172,'Gamificação para turismo com aplicação de prâticas crowdsourcing marketing ','2020','','','2022-10-07','2022-10-07','Aplicação gamificada para apoiar prâticas de crowdsourcing marketing no turismo, com abordagem ao marketing, sustentabilidade, educação, mobilidade e tecnologia.',NULL,'A Aguardar Atribuição',NULL,'DEISI172','','p3478','p3478'),(173,'Sistema de gestão de uma empresa de atividades nâuticas e alojamento ','2020','','','2022-10-07','2022-10-07','Pretende-se com este trabalho continuar o desenvolvimento de uma plataforma web para gestão das actividades da Wakevilla LDA, uma empresa de actividades nauticas e alojamento. Esta pequena empresa, identificou algumas necessidades que podem que podem ser colmatadas através do desenvolvimento de uma aplicação web. O principal objectivo deste TFC é criar uma nova funcionalidade, na app jâ existente, que permita a gestão do alojamento e que faça a ligação a sites como o booking. ',NULL,'Publicado',NULL,'DEISI173','','p5403','p5403'),(176,'Aplicação para a controlo de mapas multispectrais (2D e 3D) a partir de Drones','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação móvel que consiga monitorizar mapas 2D e 3D multispectrais. Este trabalho insere-se em parceria com uma empresa portuguesa.',NULL,'Publicado',NULL,'DEISI176','','p6115','p6115'),(177,'Framework para Redes Colaborativas','2020','','','2022-10-07','2022-10-07','Cada participante poderâ focar num componente específico. Pretende-se criar uma framework criando novos métodos, estratégias, APIs, ferramentas de gestão de informação e do conhecimento em redes colaborativas de organizações, modelos e anâlise dos processos sociotécnicos de colaboração, e para redes de negócios colaborativos, através da gestão de recursos, planeamento e coordenação em redes dinâmicas, otimização heurística de objetivos, e inter-operacionalidade técnica e semântica. ',NULL,'A Aguardar Atribuição',NULL,'DEISI177','','p3478','p3478'),(178,'Agregador semântico multi-temâtico ','2020','','','2022-10-07','2022-10-07','Portal social, com pesquisa natural, adaptativo a cada utilizador, agregador multi-temâtico de publicações de blogs, portais e outros recursos.',NULL,'Publicado',NULL,'DEISI178','','p3478','p3478'),(179,'Gamificação de um website empresarial','2020','','','2022-10-07','2022-10-07','Pretende-se a criação de um website com backoffice para gerir a aplicação e a base de dados, por consequência, estimula o interesse dos utilizadores e o seu envolvimento para com a aplicação e a organização. A gamificação é utilizada para nos motivar a realizar determinadas ações de forma a atingirmos objetivos e ganharmos recompensas.',NULL,'Publicado',NULL,'DEISI179','','p3478','p3478'),(18,'Interactive query builder','2018','','','2022-10-07','2022-10-07','A solução a criar deverâ permitir a um utilizador não conhecedor da linguagem SQL criar relatórios a partir de um base de dados a que lhe seja dado acesso, podendo imprimi-los ou exporta-los para ficheiro externo\nO TFC continua trabalho anterior que jâ executa queries elementares com SGBD MS-SQL e MySQL, com exportação em formato MS-Excel e XML\nNesta fase, pretende-se desenvolver interface grâfico, aprofundar construção de queries, permitir impressão e acrescentar o SGBD PostgreSQL',NULL,'A Aguardar Atribuição',NULL,'DEISI18','','p2703','p2703'),(180,'Mobile TV com Android','2020','','','2022-10-07','2022-10-07','Criação de uma aplicação Android, que possibilite a interação com o utilizador e ver televisão através de dispositivos móveis, com tecnologias HTTP Streaming, por meio do MPEG-DASH.',NULL,'Publicado',NULL,'DEISI180','','p3478','p3478'),(181,'Luso-LogiSim','2020','','','2022-10-07','2022-10-07','Dominar o simulador LogiSim (código aberto) usado na disciplina de Arquitectura de Computadores da LEI/RT:\na)-Incluir uma Biblioteca \"Lusofona\" com componentes específicos usados nas aulas de SD e AC.\nb)-Compilar uma versão do simulador personalizada com outras funcionalidades.\nRequisitos do único aluno - Média mínima de SD/AC de catorze valores; Programação JAVA; Desenho Grâfico.\nPesquisa:\"LogiSim\"; JAVA programming\";',NULL,'A Aguardar Atribuição',NULL,'DEISI181','','p1059','p1059'),(182,'Luso-Arduino','2020','','','2022-10-07','2022-10-07','Dominar a plataf/ Arduino com comunic/ para servir de base a TFCs futuros:Gerar libs específicas \"Lusofona\";Definir um método para gerar placas de circuit/ optimizados em termos de custo usando a plataf/;Além de código bâsico exemplo, serão incluídas na biblioteca módulos para sensores bâsicos (I/O digital, Temp/ e Humidade); GPS; Acelerómetro de 3 eixos e LoRa;Serâ apres/ no final um demonst/ com coms LoRa em rede \"Mesh\". Nota: O prof. fornece o hardw necessârio e acesso a LAB de electrónica.\n',NULL,'Publicado',NULL,'DEISI182','','p1059','p1059'),(183,'Luso-APPMovel','2020','','','2022-10-07','2022-10-07','Estudar plataformas de programação móvel adaptadas ao ensino: a)-Começar por estudar a plataf/ \"APP Inventor\" do MIT b)-Confront/ com alternat/. Apres/ tabela comparativa.c)-Apresentar um demonst/ usando a plataf/ escolhida: acesso a base de dados remota e coms usando RS232/Bluetooth para  comunicar com mód/ específ/ (p.ex sensores de temp/; I/Os digitais, etc. em arduinos ou outros).Requis/ do único aluno: Aproveit/ a SD e AC.Nota: O prof. fornece o hardw necess/ e acesso a LAB de electrónica.',NULL,'Publicado',NULL,'DEISI183','','p1059','p1059'),(184,'Telemóvel como instrumento musical em orquestra de computadores em rede','2020','','','2022-10-07','2022-10-07','Desenvolvimento de uma aplicação móvel que transforme o telemóvel num instrumento musical.\nNo backoffice existirâ uma base de dados de sons e funções de transformação. No telemóvel, um interface permitirâ escolher sons e transformações que serão parametrizadas pelos sensores do telemóvel. A série temporal de sinais dos sensores serâ enviada para o backoffice que gerarâ os sons transformados, sendo reproduzidos e integrados numa orquestra de computadores em rede. lucio.studer@ulusofona.pt',61,'Publicado',NULL,'DEISI184','','p6069','p6069'),(185,'Plataforma para gestão de agrupamento musical','2020','','','2022-10-07','2022-10-07','Desenvolvimento de uma aplicação web para apresentação e gestão da atividade de agrupamentos musicais. Deverâ congregar informação variada do agrupamento, e permitir criar e gerir eventos, inserindo texto, fotos, videos, localização. Deverâ usar uma mailing list e interagir com o Facebook e Instagram para publicitar automaticamente os eventos, antes e depois. Deverâ apresentar dashboards da sua atividade (mapa, salas de concerto, número de concertos, page views). lucio.studer@ulusofona.pt',57,'Publicado',NULL,'DEISI185','','p6069','p6069'),(189,'Plugin Drop-Project v2','2020','','','2022-10-07','2022-10-07','Estâ a ser desenvolvimento um plugin para interacção com o DP a partir do IntelliJ. Neste momento o plugin jâ permite fazer as submissões a partir do IDE. Pretende-se melhorar este projecto, através de:\n- testes com utilizador (em aula) para identificar pontos de melhoria (da GUI e não só);\n- acrescentar funcionalidades para Professor (p.e. um Professor pode querer ir buscar uma submissão feita por um aluno para o seu próprio computador);\nSerâ dada preferência a trabalhos individuais.',NULL,'Publicado',NULL,'DEISI189','','p4453','p4453'),(19,'Geoplacement (controlo de presença electrónico)','2018','','','2022-10-07','2022-10-07','Solução de validação de presença e acesso a espaços controlados utilizando dispositivos de comunicação moveis pessoais. \nComposta por 2 elementos:\n1. Marcador físico colocado no local onde se controla presença e acesso (alternativa com emissor Beacon);\n2. Aplicação móvel para ler o marcador/emissor e registar leitura em base de dados central, após validar geolocalização.\nNesta fase do trabalho, não é requerido desenvolvimento de BackOffice, mas pode se desenvolvido para como PoC. ',NULL,'Atribuido',NULL,'DEISI19','','p2703','p2703'),(192,'Rede colaborativa inter-organizacional','2020','','','2022-10-07','2022-10-07','As redes não só ajudam os agentes a atingir massa crítica e económica de escala, mas também a abranger mercados maiores e mais diversificados, o que não aconteceria se os mesmos agentes trabalhassem isolados. Pretende-se criar redes fortes e motivar a inovação, assim, propõe-se a articulação de uma rede de atores.',NULL,'A Aguardar Atribuição',NULL,'DEISI192','','p3478','p3478'),(195,'App Mobile para Registo de Notas de Campo','2020','','','2022-10-07','2022-10-07','Esta aplicação móvel terâ como objetivo auxiliar no registo de notas de campo que agora são efetuadas em papel. A aplicação enviarâ estes registos para um servidor que irâ reter todos estes dados. A aplicação deve também funcionar em modo offline para a eventualidade de não se conseguir ligar ao servidor.',46,'Publicado',NULL,'DEISI195','','p5502','p5502'),(196,'Machine Learning e a interoperabilidade com RPA (Robotic Process Automation)','2020','','','2022-10-07','2022-10-07','Os estudantes deverão desenvolver algorítmicos da aprendizagem automâtica, assim como técnicas de resolução dos desafios apresentados por cada conjunto de dados, adequados para cada problema e aplicar os algoritmos a novos conjuntos de dados. Este sistema deverâ operar em conjunto com sistemas de Robotic Process Automation (RPA) fornecendo dados para a tomada de decisão. Apresentação de um POC elaborado com recurso a um sistema de ML em conjunto com um RPA (UiPath; Blueprism; etc. / open source)',62,'A Aguardar Atribuição',NULL,'DEISI196','','p901798','p901798'),(197,'Chat / Voice e a interoperabilidade com Robotic Process Automation (RPA) ','2020','','','2022-10-07','2022-10-07','Os estudantes deverão desenvolver um sistema de chatbot que recorra a NLP/IA, recorrendo a uma framework à sua escolha. Este sistema deverâ operar em conjunto com sistemas de Robotic Process Automation (RPA) fornecendo dados com os quais estes irão interagir. Apresentação de um POC elaborado com recurso a um Chatbot a trabalhar em conjunto com um RPA (UiPath; Blueprism; etc. / open source)',62,'A Aguardar Atribuição',NULL,'DEISI197','','p901798','p901798'),(198,'Pandora - Yet Another Automated Assessment Tool','2020','','','2022-10-07','2022-10-07','O Pandora é uma ferramenta de avaliação automâtica desenhada para correr testes de input/output sobre código C. Pretende-se com este trabalho expandir as funcionalidades desta plataforma. Algumas das novas funcionalidades são:  \nGeração automâtica de testes input/output\nGeração e avaliação de testes unitârios\nMelhorar o interface de administração;\n',NULL,'Publicado',NULL,'DEISI198','','p5403','p5403'),(199,'Android Walk Test App','2020','','','2022-10-07','2022-10-07','Desenvolvimento de um aplicativo Android que permita colectar medições da rede móvel celular (drive tests). As medições são armazenadas temporariamente no dispositivo móvel e enviadas para a plataforma Metric ( https://metric.pt/ ), SaaS para planeamento de redes móveis da Multivision. Existe um Minimum Viable Product ( shorturl.at/euHLP ) que serâ expandido com novas funcionalidades tais como visionamento de informação georeferenciada num mapa que aumente a consciência do utilizador na rede.',63,'Publicado',NULL,'DEISI199','','p6069','p6069'),(20,'Plataforma de subscrição de serviços','2018','','','2022-10-07','2022-10-07','Construção de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrição de serviços, disponibilizados em formato de partilha de tempo  e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes.\nO presente TFC tem por objecto definir o modelo conceptual para o Ecossistema e a construção de um PoC  para validação do mesmo.',NULL,'Atribuido',NULL,'DEISI20','','p2703','p2703'),(200,'Plataforma de Gestao da Federação de Andebol','2020','','','2022-10-07','2022-10-07','Desenvolvimento de plataforma de gestão de equipas, jogos, campeonatos, torneios, etc. da Federação Portuguesa de Andebol. Pretende-se estruturar um novo modelo tecnológico e automatizado de toda a atividade desportiva.',64,'Publicado',NULL,'DEISI200','','p3113','p3113'),(202,'Robot de reconhecimento de espaços','2020','','','2022-10-07','2022-10-07','Pretende-se desenvolver um robot que consiga mapear o espeço envolvente, identificando obstâculos \nO material serâ disponibilizado pelo orientador.\nTrabalho jâ atribuído',NULL,'Publicado',NULL,'DEISI202','','p2703','p2703'),(203,'Data Science em Gastronomia Computacional','2020','','','2022-10-07','2022-10-07','Gastronomia Computacional é um campo científico emergente que alia as Ciências Informâticas e o Big-Data.\nA importância da Gastronomia Computacional é diversa: desde a sua utilização em impressoras 3D na impressão de alimentos, ao turismo e à inspiração do processo criativo de um Chef.\nEste projeto tem como objetivo que o aluno colabore com investigadores do Copelabs e ISMAT no desenvolvimento científico e informâtico de uma plataforma Web direcionada para a Gastronomia Portuguesa e Turismo.',65,'Publicado',NULL,'DEISI203','','p4492','p4492'),(207,'Gestão de Portfólio de Projetos e Releases','2020','','','2022-10-07','2022-10-07','Numa empresa existem inúmeras iniciativas de projetos de IT e pedidos de novos requisitos é sempre complexo o processo de controlar, recomendar e decidir quais serão implementados. Os recursos humanos e financeiros são sempre limitados, sendo o papel de um PMO cada vez mais importante.\nO objetivo deste trabalho tem como foco as atividades de Gestão e Planeamento de Projetos e de Construção, Controle e Execução de Releases da empresa a realizar pelo PMO e realização de protótipo.',NULL,'Publicado',NULL,'DEISI207','','p2','p2'),(208,'Chatbot inteligente para implementar sistema de recomendações ','2020','','','2022-10-07','2022-10-07','O objetivo de este TFC é apoiar ao aluno/a na sua formação na ârea de chatbots, especificamente chatbots que usam algum mecanismo inteligente recomendar acções a tomar num contexto dado. Neste projeto usamos dados recolhidos no âmbito de conversas entre jovens online. O chatbot irâ recomendar a tomadores de decisão que intervenções educativas poderão reforçar boas prâticas nas interações online. Os dados a serem utilizados são dados simulados para testes gerados a partir de dados reais.',NULL,'Publicado',NULL,'DEISI208','','p5265','p5265'),(209,'Implementação de Integração de Dados da Federação de Andebol','2020','','','2022-10-07','2022-10-07','Desenvolvimento de plataforma de integração de dados e gestão de ficheiros. Pretende-se estruturar um novo modelo tecnológico e automatizado de toda a atividade desportiva.',66,'Publicado',NULL,'DEISI209','','p3113','p3113'),(21,'Sistema de Avaliação de Desempenho em Recursos Humanos (SAD-RH)','2018','','','2022-10-07','2022-10-07','Desenvolver interface de avaliação para SAD-RH, de acordo com critérios e métricas de avaliação definidas pela DRH.\nA interface integra com ERP de Gestão de RH para identificação de funcionârios e interacção com histórico de avaliações, mas tem autonomia para validação de preenchimento',5,'Atribuido',NULL,'DEISI21','','p2703','p2703'),(210,'Integração de avaliação na Aplicação MentHA','2020','','','2022-10-07','2022-10-07','Integrar a avaliação na aplicação MentHA. Deverâ  integrar as perguntas e cotações das vârias partes do protocolo. Deverâ ser implementada a cotação automâtica de respostas de escolha múltipla assim como o regiso manual nas restantes. O modelo de dados devera espelhar a estruturação do Protocolo em Parte  area de avaliação  teste  dimensão  pergunta. Um relatório deverâ apresentar as cotações de forma grâfica, recorrendo a dashboards.',60,'publicado',NULL,'DEISI210','','p6069','p6069'),(211,'Plataforma de Monitorização de Impressoras 3D de Construção de Casas','2021','','','2022-10-07','2022-10-07','Plataforma de gestão e monitorização de IoT de Impressoras 3D de construção de casas, usando sensores e arduinos. Projeto no âmbito de parceria com empresa Youcoders, no âmbito do Seed Funding da Universdade Lusófona',55,'Publicado',NULL,'DEISI211','','p3113','p3113'),(212,'Buddy abroad - Front End','2021','','','2022-10-07','2022-10-07','Fusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de interface app mobile e Web de Gestão de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',53,'Publicado',NULL,'DEISI212','','p5932','p3113'),(213,'Buddy abroad - Back End','2021','','','2022-10-07','2022-10-07','Fusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de interface de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',53,'Publicado',NULL,'DEISI213','','p5932','p3113'),(214,'BestRide - Front End','2021','','','2022-10-07','2022-10-07','Desenvolvimento de interface app mobile e web de gestão de plataforma de Gestão de Tuk Tuk. Conceitos: \n1- Um turista pode escolher roteiros de viagens\n2- Um condutor de tuk tuk define roteiros, recebe pagamentos\n3- Plataforma retém fee de comissão\n4- Plataforma Web de gestão de turistas e condutores\n',53,'Publicado',NULL,'DEISI214','','p3113','p3113'),(215,'Content Marketplace platform','2021','','','2022-10-07','2022-10-07','Lançamento de Prototipo desenvolvido em TFCs de anos anteriores (2019 - anâlise de requisitos; 2020 - prototipagem) de plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. Funcionalidades futuras: disseminar conteúdo de redes sociais ser aprovado, disseminar diretamente em vârias redes sociais.',67,'Publicado',NULL,'DEISI215','','p3113','p3113'),(216,'Acompanhamento nutricional em farmâcias','2021','','','2022-10-07','2022-10-07','Em colaboração com o Departamento de Ciências Farmacêuticas, pretende-se desenvolver uma aplicação web para registo e monitorização de dados clínicos associados a utentes farmacêuticos que estejam a seguir um programa nutricional. O trabalho inclui uma fase inicial de levantamento de requisitos com base em focus groups envolvendo farmacêuticos, nutricionistas e pacientes. O objetivo é produzir uma aplicação piloto que serâ utilizada por 2 ou 3 farmâcias.\nNota: Este TFC jâ estâ atribuído',68,'Publicado',NULL,'DEISI216','','p4997','p4997'),(217,'Site DEISI','2021','','','2022-10-07','2022-10-07','Anâlise e reformulação do site institucional do DEISI. Anâlise de usabilidade e SEO. Anâlise de CMS que suportem o site. Reformulação da arquitetura de navegação. Inclusão de pâginas dinâmicas construídas a partir de uma BD. Ligação a APIs externas (ex: Linkedin, Github).',NULL,'Publicado',NULL,'DEISI217','','p4997','p4997'),(218,'Gestão de centros de investigação','2021','','','2022-10-07','2022-10-07','Continuação do desenvolvimento de uma uma aplicação web com a responsabilidade de gerir toda a informação dos investigadores de um centro de investigação: equipa de investigadores, atividades desenvolvidas, publicações, etc. Este desenvolvimento estâ integrado num projecto do CeiED (Centro de Estudos Interdisciplinares em Educação e Desenvolvimento), mas pretende-se que seja alargado a outros centros no futuro.',69,'Publicado',NULL,'DEISI218','','p4997','p4997'),(219,'App4SHM 2.0','2021','','','2022-10-07','2022-10-07','Pretende-se evoluir uma aplicação Android nativa (Kotlin) que mede a integridade de uma estrutura (ex: ponte) através de leituras do acelerómetro e processa esses dados através de algoritmos de machine learning. Novas funcionalidades: versão em iOS, sincronização de vârios dispositivos; utilização de docker; melhorias diversas. Este trabalho estâ inserido num projecto de investigação do Departamento de Engenharia Civil.\nUm dos alunos deve possuir um Mac (para desenvolvimento iOS)',70,'Publicado',NULL,'DEISI219','','p4997','p4997'),(221,'Acompanhamento de processos judiciais','2021','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação web para recolha de informação relativa a processos judiciais e posterior obtenção de indicadores estatísticos relevantes para identificação de situações anómalas. Este projeto serâ desenvolvido em conjunto com a Faculdade de Direito e estâ inserido num projeto de investigação do programa\"Fazer +\".',71,'Publicado',NULL,'DEISI221','','p4997','p4997'),(222,'BestRide - back End','2021','','','2022-10-07','2022-10-07','Desenvolvimento de servicos de gestão de plataforma de Gestão de Tuk Tuk. Conceitos: \n1- Um turista pode escolher roteiros de viagens\n2- Um condutor de tuk tuk define roteiros, recebe pagamentos\n3- Plataforma retém fee de comissão\n4- Plataforma Web de gestão de turistas e condutores\n',72,'Publicado',NULL,'DEISI222','','p3113','p3113'),(223,'Aplicação para gestão de uma AUGI e situação atual na Região da Grande Lisboa','2021','','','2022-10-07','2022-10-07','Hâ muitos anos atrâs, muitos terrenos foram objeto de operações físicas de parcelamento destinadas à construção e vendidos lotes a particulares, sem existência de infraestruturas e processos de licenciamento. Foram criadas pelas Câmaras Municipais vârias AUGI (Íreas Urbanas de Génese Ilegal). Pretende-se com o presente trabalho fazer o ponto de situação nas vârias Câmaras Municipais da ârea da Grande Lisboa e desenvolver uma aplicação para fazer a Gestão da atividade de uma AUGI.',73,'Publicado',NULL,'DEISI223','','p2','p2'),(224,'Aplicação de geração de testes a software','2021','','','2022-10-07','2022-10-07','Para que uma aplicação cumpra os objetivos para os quais foi implementada é fundamental assegurar que ela satisfaz as necessidades e requisitos definidos. Quando se verificam atualizações ou adição de requisitos, é fundamental garantir que para além das novas funcionalidades, também as anteriores continuam a funcionar, fazendo testes de regressão.\nPretende-se com base em Use Cases desenvolver uma aplicação que gere (e opcionalmente execute) testes de aceitação e conformidade da aplicação.',NULL,'Publicado',NULL,'DEISI224','','p2','p2'),(225,'PMO, Gestão de Portfólio de Projetos e Releases','2021','','','2022-10-07','2022-10-07','Numa empresa existem inúmeras iniciativas de projetos de IT e pedidos de novos requisitos. É sempre complexo o processo de controlar, recomendar e decidir quais serão implementados. Os recursos humanos e financeiros são sempre limitados, sendo o papel de um PMO cada vez mais importante.\nO objetivo deste trabalho tem como foco as atividades de Gestão e Planeamento de Projetos e de Construção, Controle e Execução de Releases da empresa a realizar pelo PMO e realização de protótipo.',NULL,'Publicado',NULL,'DEISI225','','p2','p2'),(226,'Plataforma de gestão de requisitos','2021','','','2022-10-07','2022-10-07','Desenvolver plataforma online para avaliação de requisitos e gestão do seu ciclo de vida seguindo modelo de AGSI (Arquitectura da Gestão de Sistemas de Informação)\nAs tecnologias listadas são indicativas, baseadas em desenvolvimentos anteriores, podem ser alteradas em função de avaliação de situação a realizar na 1ª fase do TFC',NULL,'Publicado',NULL,'DEISI226','','p2703','p2703'),(227,'Plataforma de subscrição de serviços','2021','','','2022-10-07','2022-10-07','Construção de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrição de serviços, disponibilizados em formato de partilha de tempo e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes. Para este ano lectivo o objectivo é desenvolver a plataforma de publicação e subscrição de serviços, segundo as especificações do modelo conceptual produzido em TFC anterior',NULL,'Publicado',NULL,'DEISI227','','p2703','p2703'),(231,'Plugin Drop Project - v3 (projecto individual)','2021','','','2022-10-07','2022-10-07','Existe 1 plugin que permite a alunos e professores interagirem com o DP a partir do IntelliJ. O plugin tem funcionalidades em falta (ex: falta autenticação em alguns web services) que impedem o seu uso em produção. Objectivos: 1) implementar as funcionalidades em falta; 2) colocar em produção (p.e. uso em mini-testes); 3) corrigir bugs que sejam encontrados em produção. A funcionalidade (item 1) deve estar pronta no final do 1º semestre, para poder ser usado em produção no 2º semestre.',NULL,'Publicado',NULL,'DEISI231','','p4453','p4453'),(232,'Plataforma de gestão de eventos - v3 (projecto individual)','2021','','','2022-10-07','2022-10-07','Pretende-se dar continuidade ao desenvolvimento de uma plataforma Web de gestão de eventos, que permite a pessoas com o papel de administradores a criação de eventos nos quais outras pessoas , se podem inscrever, mediante um pagamento baseado num plafond. Existem vârias funcionalidades em falta que se pretendem implementar (p.e. renovação anual do plafond, integração com LDAP). Para além disso, pretende-se converter o sistema de Mongo para uma base de dados relacional e colocar em produção.',NULL,'Publicado',NULL,'DEISI232','','p4453','p4453'),(233,'Aplicação Web para transformação digital do protocolo MentHA','2021','','','2022-10-07','2022-10-07','Desenvolver uma aplicação Web para a transformação digital do protocolo MENTHA (Mental Health and Aging) de avaliação neuropsicológica de pessoas mais velhas com défice cognitivo ou demência leve. O protocolo é constituído por um conjunto de testes, devendo a aplicação permitir registar avaliadores e pacientes, gerir e aplicar testes, criar relatorios e fazer anâlise comparativa de dados. Preferência a grupos com disponibilidade para trabalhar presencialmente 1-2 dias por semana no COPELABS.',74,'Publicado',NULL,'DEISI233','','p6069','p6069'),(234,'Aplicação Web para transformação digital do programa de estimulação cognitiva MenthaCOG','2021','','','2022-10-07','2022-10-07','Desenvolver uma aplicação Web que faça a transformação digital do programa de estimulação cognitiva MenthaCOG (Mental Health and Aging) dirigido a pessoas mais velhas com défice cognitivo ou demência leve. A aplicação serâ constituída por jogos, tarefas e quizzes multimédia que incidam sobre a funcionalidade cognitiva e social. Preferência a grupos com disponibilidade para trabalhar presencialmente 1-2 dias por semana no COPELABS.',74,'Publicado',NULL,'DEISI234','','p6069','p6069'),(235,'Aplicação Web MenthaCare','2021','','','2022-10-07','2022-10-07','Desenvolver uma aplicação Web  que faça a transformação digital do programa MenthaCare, dirigido a cuidadores de pessoas mais velhas com défices conitivos e doença mental previa. Com o objetivo de dinamizar grupos psicoeducativos de ajuda mutua, deverâ permitir criar e gerir a atividade de grupos, permitindo o registo de moderadores e cuidadores, criar eventos, forums, quizzes assim como gerir conteúdos. Dada preferência a disponibilidade para trabalhar 1-2 dias por semana no COPELABS',74,'Publicado',NULL,'DEISI235','','p6069','p6069'),(236,'Aplicação Web para estimação de cobertura celular de drones por sistemas de comunicações móveis 4G e 5G. ','2021','','','2022-10-07','2022-10-07','Aplicação Web que estime o sinal recebido de uma estação base 4G/5G num drone em voo, considerando as características da antena, morfologia do terreno e dados vectoriais de edifícios, sendo o cenârio representado em 3D. Deverão ser aplicados modelos de propagação adequados por forma a estimar a intensidade de sinal recebido em qualquer ponto 3D em redor da antena. Preferência a grupos com disponibilidade para trabalhar presencialmente 1-2 dias/semana no COPELABS. Coorientador: Daniel Fernandes.',75,'Publicado',NULL,'DEISI236','','p6069','p6069'),(237,'Plataforma de gestão financeira para controlo de custos empresariais','2021','','','2022-10-07','2022-10-07','WebApp para registo de vendas e custos diârios com a finalidade de produzir mapas para apoio à decisão. Aplicação serâ feita em Django.',NULL,'Publicado',NULL,'DEISI237','','p5403','p5403'),(238,'Plataforma de ensino online para oficiais da federação internacional de wakeboard','2021','','','2022-10-07','2022-10-07','Prototipagem de uma aplicação para ensino e avaliação online de juizes de provas de wakeboard. O projecto passa por uma identificação das tecnologias a utilizar seguido de uma fase de implementação, teste e deployment. ',76,'Publicado',NULL,'DEISI238','','p5403','p5403'),(239,'Aplicação móvel para avaliação de provas de wakeboard','2021','','','2022-10-07','2022-10-07','Desenvolvimento de uma aplicação móvel para ser utilizada pelo juri das provas de wakeboard durante as provas.',76,'Publicado',NULL,'DEISI239','','p5403','p5403'),(24,'Content Marketplace platform','2018','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, ebooks, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. Esta plataforma deverâ posteriormente ter funcionalidades como depois de um determinado conteúdo de redes sociais ser aprovado, disseminar diretamente em vârias redes sociais.',11,'Indisponivel',NULL,'DEISI24','','p3113','p3113'),(240,'Software de câlculo para a gestão completa de uma competição de wakeboard','2021','','','2022-10-07','2022-10-07','Prototipagem de uma aplicação responsâvel pela gestão de competições de wakeboard. A aplicação deverâ ser capaz de organizar os altetas em grupos (baterias) consoante a sua pontuação global e gerir as pontuações e progressões dos atletas num torneio.',76,'Publicado',NULL,'DEISI240','','p5403','p5403'),(241,'Parque de Estacionamento - Front End','2021','','','2022-10-07','2022-10-07','Desenvolvimento de interface app mobile e Web de Gestão de plataforma no âmbito do parque de estacionamento da Universidade Lusófona.',NULL,'Publicado',NULL,'DEISI241','','p6115','p6115'),(242,'Parque de Estacionamento - Back End','2021','','','2022-10-07','2022-10-07','Desenvolvimento back end no âmbito do parque de estacionamento da Universidade Lusófona.',NULL,'Publicado',NULL,'DEISI242','','p6115','p6115'),(243,'Parque de Estacionamento - Detector de matrículas','2021','','','2022-10-07','2022-10-07','Desenvolvimento de um sistema capaz de detectar matrículas dos carros no âmbito do parque de estacionamento da Universidade Lusófona.',NULL,'Publicado',NULL,'DEISI243','','p6115','p6115'),(246,'Uma framework de consistência de estado para Redes Definidas por Software (SDNs)','2021','','','2022-10-07','2022-10-07','A tecnologia de Rede Definida por Software (SDN) é um método de gestão de rede que permite um planeamento dinâmico e programaticamente eficiente da mesma, a fim de melhorar o seu desempenho e monitorização. A existência nestas redes duma ferramenta que permita garantir uma comunicação fidedigna e um estado global entre os dispositivos é desejâvel. Este projeto visa propor uma estrutura de consistência de estado para proteger a rede contra a possibilidade de inconsistências de estado.',NULL,'Publicado',NULL,'DEISI246','','p6368','p6368'),(247,'Encaminhamento Inteligente baseado em técnicas de Inteligência Artificial para Redes Centradas em Informação','2021','','','2022-10-07','2022-10-07','O objetivo deste projeto é desenvolver um protocolo de encaminhamento baseado em Inteligência Artificial permitindo a tomada de decisões inteligente de encaminhamento em Redes Centradas em Informação.',NULL,'Publicado',NULL,'DEISI247','','p6368','p6368'),(249,'Test Automation - IPA (intelligent process automation) component to support business continuity management ','2021','','','2022-10-07','2022-10-07','Desenvolvimento de um trabalho académico relacionado com o desdenvolvimento de componentes de IPA/RPA (Robotic Process Automation).\nEsta componente aplicacional irâ ser baseada nos conceitos de automação de testes baseada em identificação fluxos (process mining), definição de resultados, deployment de fluxos de testes, anâlise de resultados e data mining.\n',78,'Publicado',NULL,'DEISI249','','p6255','p6255'),(25,'Buddy abroad','2018','','','2022-10-07','2022-10-07','Fusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',12,'Atribuido',NULL,'DEISI25','','p3113','p3113'),(256,' Tickets  e anâlise estatística - Front End e Back End','2021','','','2022-10-07','2022-10-07','Aplicação de gestão empresarial com suporte para resolução de tickets  e anâlise estatística dos mesmos . O projeto serâ dividido em componente de back e front end.',NULL,'Publicado',NULL,'DEISI256','','p6115','p6115'),(257,'Design inclusivo (e acessível) em canais de vendas online ','2021','','','2022-10-07','2022-10-07','O objetivo deste TFC é o estudante aplicar os conhecimentos adquiridos nas UCs de Interação Humano Mâquina e Aplicações para a Web aos canais de venda online (Web e Mobile) de uma empresa. Como? Investigando e avaliando o nível de conformidade com as normas da WCAG, propondo um novo desenho e/ou alterações à programação por forma a tornar os canais mais acessíveis a pessoas com incapacidades, sejam elas permanentes ou temporârias. O projeto serâ realizado em parceria com uma empresa.',81,'Publicado',NULL,'DEISI257','','p2211','p2211'),(258,'Modelamento multi-agente de interações em grupos sociais.','2021','','','2022-10-07','2022-10-07','O objetivo de este TFC é desevolver um modelo baseado em agentes para estudar como as normas sociais influenciam comportamentos intra-grupo e inter-grupo através de simulações. Durante o TFC o aluno estudarâ a literatura clâssica de sistemas multi-agente no contexto de redes sociais, e irâ usar dados reais obtidos em escolas Portuguesas para a construção e validação do seu modelo. Este TFC de cariz científico estâ orientado à possibilidade de publicar os resultados.',NULL,'Publicado',NULL,'DEISI258','','p5265','p5265'),(260,'Desenvolvimento de aplicação WEB em PHP usando o gerador de código PhpMyEDIT','2021','','','2022-10-07','2022-10-07','Desde o inicio do século que hâ geradores de código baseados em tabelas. Este tipo de software aponta para uma tabela e faz a geração de todo o código CRUD a partir dos campos da tabela. O PhpMyEdit é um gerador deste tipo, jâ com alguns anos no mercado, open source e free, que serve de base a vârios produtos comerciais. Com este trabalho propomos que o alune estude o código do PhpMyEdit e desenvolva uma aplicação WEB simples usando a geração de código.',NULL,'Publicado',NULL,'DEISI260','','p2357','p2357'),(263,'AARO - Auto Avaliação de Risco da Organização','2021','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação para identificar, documentar e avaliar os riscos operacionais associados aos principais processos de negócios. O trabalho inclui uma fase inicial de levantamento de requisitos com base em focus groups envolvendo elementos da ârea de risco e continuidade do negócio. O objetivo é produzir uma aplicação piloto que serâ utilizada por empresas do setor financeiro (banca ou seguros).\nTema jâ atribuido',78,'Publicado',NULL,'DEISI263','','p6255','p6255'),(265,'DataHub','2021','','','2022-10-07','2022-10-07','Desenvolvimento API de base Cloud para integração multi-aplicaional.\nPretende-se desenvolver uma solução que centralize e distribua alterações a dados de vârias aplicações de uma organização, mediante regras precedências e necessidades operacionais ',83,'Publicado',NULL,'DEISI265','','p2703','p2703'),(268,'Classificador baseado em algoritmos de machine learning para deteção de shots em transições de video','2022','','','2022-10-07','2022-10-07','A deteção de shots constitui-se como uma tarefa fundamental para o processo de sumarização e produção de vídeos. A utilização de mecanismos baseados em inteligência artificial constitui-se como uma alternativa de especial destaque alinhada com a evolução tecnológica que temos observado ao longo dos últimos anos. O objectivo é estimular o estudo e consequente aplicação de algoritmos de inteligência artificial para o desempenho deste tipo de tarefa de forma automâtica. ',NULL,'Publicado',NULL,'DEISI268','','p5782','p5782'),(269,'Plataforma para monitorização da temperatura e posição corporal com detecção/alarme de quedas','2022','','','2022-10-07','2022-10-07','Diversas aplicações têm surgido no âmbito da internet das coisas e a saúde tem adquirido um particular destaque neste âmbito. Neste projecto pretende-se implementar uma plataforma de visualização sem fios para monitorização da temperatura e posição corporal, com detecção de quedas.  Os alunos são encorajados a utilizar uma linguagem de programação com a qual se sintam confortâveis e toda a componente de aquisição serâ realizada com recurso a sensores e de um arduino. C/orientação João Carvalho',NULL,'Publicado',NULL,'DEISI269','','p5782','p5782'),(270,'Sistema para Monitorização de Plantas','2022','','','2022-10-07','2022-10-07','Diversas aplicações têm surgido no âmbito da internet das coisas e no que toca à componente de monitorização do mundo que nos rodeia tal não é excepção. Neste projecto pretende-se implementar um protótipo de um nó para monitorização e controlo de plantas usando uma rede bluetooth.  Os alunos são encorajados a utilizar uma linguagem de programação com a qual se sintam confortâveis e toda a componente de aquisição serâ realizada com recurso a sensores e de um arduino. Orientação c/João Carvalho',NULL,'Publicado',NULL,'DEISI270','','p5782','p5782'),(271,'Aplicação móvel para registo de revisões de carros','2022','','','2022-10-07','2022-10-07','Por vezes as pessoas quando levam o carro ao mecânico esquecem-se de quando é que trocaram determinada peça do carro. Esta aplicação móvel tem como objetivo permitir o registo em cloud (através do Firebase) de revisões dos carros. Esta aplicação serâ desenvolvida com recurso à (muito provavelmente) tecnologia mais evoluida do mercado, o Flutter. O Flutter permite fazer desenvolvimento móvel para iOS, Android, Web e até Desktop. \n\nEste projeto serâ desenvolvido por um aluno, não por um grupo.',NULL,'Publicado',NULL,'DEISI271','','p5502','p5502'),(272,'Solução de registo de momentos de avaliação','2022','','','2022-10-07','2022-10-07','Alguns alunos têm dificuldades em organizarem-se face aos vârios momentos de avaliação ao longo do semestre. Esta solução passa pelo desenvolvimento de uma solução que permitirâ o registo dos momentos de avaliação através de um backoffice, que consequentemente poderão ser consultados através de uma aplicação móvel.\nEsta aplicação serâ desenvolvida com recurso à tecnologia mais evoluida do mercado, o Flutter. O Flutter permite fazer desenvolvimento móvel para iOS, Android, Web e até Desktop. ',NULL,'Publicado',NULL,'DEISI272','','p5502','p5502'),(273,'Loteamentos ilegais, construções clandestinas, AUGI\'s na ârea da Grande Lisboa, ','2022','','','2022-10-07','2022-10-07','Hâ muitos anos foram feitos muitos loteamentos ilegais (muitos terrenos foram objeto de operações físicas de parcelamento ilegal para construção sem infraestruturas). Foram criadas pelas Câmaras Municipais vârias AUGI (Íreas Urbanas de Génese Ilegal). Pretende-se com o presente trabalho fazer o levantamento exaustivo no terreno na ârea da Grande Lisboa nas vârias Câmaras Municipais e criar um site para apresentação do trabalho feito, divulgação do tema e recolha de informação. Pode ser em grupo.',NULL,'Publicado',NULL,'DEISI273','','p2','p2'),(274,'Aplicação para a Gestão de uma Junta de Freguesia','2022','','','2022-10-07','2022-10-07','As Juntas de Freguesia desempenham um papel de relevo e de proximidade com os seus residentes. Face às inúmeras solicitações que recebem têm dificuldades em responder a todas as solicitações recebidas.\nPretende desenvolver-se um site onde os residentes possam aceder a informação da Junta, fazer pedidos, comunicar situações e ocorrências facilitando e permitindo a otimização de recursos',NULL,'Publicado',NULL,'DEISI274','','p2','p2'),(275,'Gestão de inventârio com base de dados dinâmica','2022','','','2022-10-07','2022-10-07','Este TFC tem dois objectivos:\n- Comparar modelos relacional com abordagem NoSQL para o uso com modelos de dados dinâmicos (não estruturados)\n- Desenvolver solução de inventârio como aplicação dos resultados do estudo comparativo\nA trabalho deverâ estudar vârias abordagens de dados utilizando ferramentas comuns de mercado (MySQL/MariaDB; MongoDB; Redis) para explorar formas distintas de trabalhar dados em ambiente empresarial',NULL,'Publicado',NULL,'DEISI275','','p2703','p2703'),(276,'Autenticação SSO','2022','','','2022-10-07','2022-10-07','Reformulação de solução existente de gestão académica, integrando com ferramenta SSO de autenticação baseada em cloud (AzureAD; Amazon Cognito; Okta; etc.)\nA solução a desenvolver deverâ permitir autenticação de ferramentas de terceiros',83,'Anulado',NULL,'DEISI276','','p2703','p2703'),(277,'Gestão de distribuição alimentar','2022','','','2022-10-07','2022-10-07','Desenvolvimento e solução Web para suporte a instituições que efectuam distribuição alimentar no âmbito de apoio à comunidade\nA solução deverâ fazer gestão de existências, aplicar regras de distribuição e manter históricos. Existe componente importante de protecção de dados pessoais\nSolução deverâ se desenvolvida em modelo web ou cloud, com interface intuitiva e leve e garantir facilidade de distribuição (ambiente Docker)\nLinguagem de desenvolvimento e SGBD a definir ',83,'Publicado',NULL,'DEISI277','','p2703','p2703'),(278,'ULHT Control Panel','2022','','','2022-10-07','2022-10-07','Aplicação web com o objetivo de facilitar a atribuição de horârios e marcações de salas, fazendo com que os horârios deixem de ser feitos de uma maneira pouco prâtica e complexa e no fundo se comece a realizar estas tarefas numa única plataforma que atualiza as informações automaticamente online.',NULL,'Publicado',NULL,'DEISI278','','p6115','p6115'),(279,'VetOn - Aplicação mobile e web para Hospital Veterinârio da Lusófona.','2022','','','2022-10-07','2022-10-07','Este projeto tem como objetivo o desenvolvimento de uma aplicação mobile e web que permita agilizar, de uma forma organizada e simples, qualquer serviço prestado pelo Hospital Veterinârio da Lusófona. ',NULL,'Publicado',NULL,'DEISI279','','p6115','p6115'),(28,'Plataforma DEISI - Gestão de FUCs','2018','','','2022-10-07','2022-10-07','Desenvolvimento de uma aplicação Web que suporte a gestão de FUCs (Fichas de Unidade Curricular), desde a sua submissão e validação até à sua publicação nos sites da Universidade e do Departamento e exportação em PDF. O projecto deverâ ser desenvolvido em Spring MVC e integrarâ com o sistema de Single Sign-On da faculdade. Incluirâ obrigatoriamente testes com utilizadores e deployment para um servidor da faculdade.\n\n(Nota: Este TFC jâ estâ em curso)',NULL,'Atribuido',NULL,'DEISI28','','p4997','p4997'),(280,'Aplicação móvel para gestão de Personal Trainers','2022','','','2022-10-07','2022-10-07','A aplicação a ser desenvolvida destina-se à gestão de clientes de um personal trainer, com possibilidade visualização e edição de horârios, notificações para os clientes, acompanhamento online, especificação de treinos, criação de eventos, pagamentos, feed de noticias, entre outras.\n\nA aplicação tem como cliente final um personal trainer certificado que irâ supervisionar e validar as funcionalidades a serem desenvolvidas.',84,'Publicado',NULL,'DEISI280','','p5932','p5932'),(281,'Aplicação blockchain para ârea de saúde','2022','','','2022-10-07','2022-10-07','A Blockchain proposta inicialmente permite que os dados fiquem publicamente visíveis para todos na rede blockchain. Desta forma, é possível garantir a confidencialidade dos dados. Portanto, é necessârio desenvolver uma arquitetura composta por seis componentes que são: usuârio, Dapp, MetaMask, Blockchain, IPFS e criptografia. O objetivo do trabalho é definir as ferramentas que serão utilizadas na implementação, bem como detalhar como foram realizadas as comunicações entre estes componentes. ',NULL,'Anulado',NULL,'DEISI281','','p5905','p5905'),(283,'Gerir  perfis de utilizadores com base em privacidade de dados para aplicativos IoT','2022','','','2022-10-07','2022-10-07',' IoT pode ser vista de diversas perspectivas, dentre as quais, destacam-se as abordagens orientadas à Internet das coisas e ao conhecimento. Quanto à forma, basicamente, IoT pode ser dividida em suporte a humanos e suporte a aplicações comerciais e industriais. Portanto, se faz necessârio desenvolver aplicações capazes de gerir dados de utilizadores e dispositivos de acordo com regras e definições de privacidade de dados. Regras de perfil de acordo com ambiente, dispositivo ou variadas.  ',NULL,'Anulado',NULL,'DEISI283','','p5905','p5905'),(284,'Comparação, uso e aplicação de algoritmos criptogrâficos em cloud computing','2022','','','2022-10-07','2022-10-07','A computação em nuvem (Cloud Computing) estâ cada vez mais presente no cotidiano das pessoas, como na medicina, em redes elétricas inteligentes (Smart Grids). Com isto surge a necessidade de proteger os dados processados pelo dispositivos IoT contra e invasores. Um bom modo de resolver este problema é através de algoritmos criptogrâficos e otimizados.  Implementar, testar e comparar com objetivo de melhorias de segurança e desenpenho são necessârios para viabilizar soluções em Cloud Computing. ',NULL,'Anulado',NULL,'DEISI284','','p5905','p5905'),(286,'Plataforma Lusofona Arduino','2022','','','2022-10-07','2022-10-07','Explorar o ambiente de progr/ do Arduino e adapta-lo para o ensino de disciplinas na faculdade e utilizacao em projetos TFC:\n- Documentar o ambiente de desenvolvimento do Arduino\n- Desenvolver varias templates de apoio aos projetos:\n  1 - Input/Output - Botoes com ADC e encoder\n  2 - Esquema de menus simples em LCD 2x16\n  3 - Esquema de menus/submenus em LCD bitmap, com grafismos simples\n  4 - Comunicacao/perifericos - UART, PWM, ADC e TIMERS\n  5 - Aplicação de demonstracao: Motor Gira',NULL,'Publicado',NULL,'DEISI286','','p1059','p1059'),(287,'Assistente Pessoal em Dispositivo Móvel','2022','','','2022-10-07','2022-10-07','Aplicação móvel usando uma plataforma de desenvolvimento standart, que pode ser uma ajuda a Pessoas com NE:\n- Studio ou APP inventor\n- Tecnologias: google speech e google recognition\n- Usa BD/Listas\n- Preparação râpida de cenârio em ficheiro simples de texto, que é carregado pela aplicação no arranque de modo a facilitar o manuseamento dos dados e desempenho.\n- Log + learning\n- Gestão de vârios cenârios\n- Reprodução de audio mp3\nAplicação exemplo (fornecida pelo prof.)\n',NULL,'Publicado',NULL,'DEISI287','','p1059','p1059'),(288,'Organizador fotos em aplicação android','2022','','','2022-10-07','2022-10-07','- Facilitador de pesquisa para fotos no  dispositivo android.\n- Execução intensiva em \"back ground\" usando as tecnologias disponíveis: reconhecimento facial e de lugares.\n- Criação de BD local com as palavras chave parametrizaveis pelo utilizador com os links das fotos: nome dos sujeitos, locais, tipo de foto (paisagem, férias, restaurantes, lojas, etc...)\n- informação da própria foto (data, etc.)\n- Uso de OCR para extração de texto.\n- Consulta local da BD',NULL,'Publicado',NULL,'DEISI288','','p1059','p1059'),(29,'Plataforma Web de Suporte a Projectos de Investigação - Parte II','2018','','','2022-10-07','2022-10-07','Este projecto enquadra-se na vertente de ambientes Web e tem como objectivo auxiliar a completar software para apoiar a gestão de projectos na Universidade Lusófona de Humanidades e Tecnologias.  O projecto é desenvolvido em joomla, em plataforma jâ iniciada (ver http://siti1.ulusofona.pt/~usersiti1/).\nNesta segunda fase, os objectivos principais são: melhorar estatística; interligar com autenticação da ULHT; envio de alertas.\n\n',NULL,'Atribuido',NULL,'DEISI29','','p4036','p4036'),(290,'Aplicação web de venda de produtos fitness e controlo de stock','2022','','','2022-10-07','2022-10-07','O sistema a ser desenvolvido tem como objetivo final a venda de produtos fitness e a criação de um painel administrativo que permita a gestão de stock de produtos, faturas, adição de novos produtos, integração de um sistema de pagamentos, conceito de carrinho de compras, entre outras.\n\nO sistema tem um cliente final que irâ supervisionar e suportar as funcionalidades a serem desenvolvidas.',85,'Publicado',NULL,'DEISI290','','p5932','p5932'),(291,'App4SHM - Aplicação móvel para deteção de danos em pontes','2022','','','2022-10-07','2022-10-07','A aplicação móvel App4SHM usa o acelerómetro para capturar as vibrações das pontes e, através de algoritmos de inteligência artificial perceber o risco de dano na ponte. A aplicação estâ atualmente desenvolvida em Android nativo mas pretende-se que seja multi-plataforma, pelo que serâ migrada para Flutter. Serão igualmente adicionadas novas funcionalidades. Isto é um trabalho feito em conjunto com o departamento de engenharia civil.\n*Nota: Este trabalho jâ estâ atribuído* ',70,'Publicado',NULL,'DEISI291','','p4997','p4997'),(292,'Aplicação web para visita virtual e gestão de lojas de um centro comercial','2022','','','2022-10-07','2022-10-07','A aplicação web destina-se a ser uma landing page para o Centro Comercial Colina do Sol, permitindo uma visita virtual através do plugin de JavaScript - https://pchen66.github.io/Panolens/#Home ou Unity WebGL.\nAlém da visita, deve também conter um painel administrativo de gestão das lojas, informações das mesmas e um mapeamento do centro comercial.\n',86,'Publicado',NULL,'DEISI292','','p5932','p5932'),(295,'Aplicação MentHA CARE para cuidadores informais','2022','','','2022-10-07','2022-10-07','No âmbito do projeto MentHA - Mental Health and Aging (https://mentha-digital.herokuapp.com/), o programa MentHA CARE é um programa psico-educativo para cuidadores de adultos mais velhos com demência. Pretende-se continuar o desenvolvimento da aplicação web desenvolvida em TFC anterior, integrando funcionalidades, acompanhando a sua utilização pelos parceiros (Cruz Vermelha Portuguesa, FamiliarMente,Elo Social,ASMAL,ADEB,GIRA) incluindo melhorias sugeridas. Co-orientação: Pedro M.Santos',87,'Publicado',NULL,'DEISI295','','p6069','p6069'),(296,'Aplicação MentHA para treino cognitivo','2022','','','2022-10-07','2022-10-07','O projeto MentHA - Mental Health and Aging (https://mentha-digital.herokuapp.com/) visa o treino cognitivo de adultos mais velhos com demência. Pretende-se continuar o desenvolvimento das aplicações desenvolvidas em TFCs anteriores. O trabalho irâ consistir na integração de novas funcionalidades, acompanhamento da sua aplicação nos parceiros do projeto (Cruz Vermelha Portuguesa, FamiliarMente,Elo Social,ASMAL,ADEB,GIRA) e introdução de melhorias sugeridas. Co-orientação: Pedro M.Santos',88,'Publicado',NULL,'DEISI296','','p6069','p6069'),(297,'Aplicação para gestão de competições de wakeboard - frontend','2022','','','2022-10-07','2022-10-07','Numa competição de wakeboard, os atletas são distribuídos de acordo com categorias e competem entre si em grupos. Os vencedores de cada grupo passam às fases seguintes até chegarem à final. Este trabalho irâ focar-se sobretudo no desenvolvimento do frontend para esta aplicação.',89,'Publicado',NULL,'DEISI297','','p5403','p5403'),(298,'PTR - Poomsae Tournament Refereeing','2022','','','2022-10-07','2022-10-07','O Poomsae Jury Online é um website de arbitragem de Poomsae de Taekwondo. Este conecta os dispositivos dos 5 júris através de um código ao mesmo, onde é feita uma média da classificação dos júris para cada atleta de acordo com as regras da WT (World Taekwondo). A base de dados estaria dividida por categorias, tendo em cada uma os competidores e as suas classificações. Estas classificações estariam disponíveis numa tabela em tempo real numa outra pâgina acessível pelo público.',106,'Publicado',NULL,'DEISI298','','p6115','p6115'),(299,'Content Marketplace platform','2022','','','2022-10-07','2022-10-07','Lançamento de Prototipo desenvolvido em TFCs de anos anteriores (2019 - anâlise de requisitos; 2020 - prototipagem) de plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. Funcionalidades futuras: disseminar conteúdo de redes sociais ser aprovado, disseminar diretamente em vârias redes sociais.',67,'Publicado',NULL,'DEISI299','','p3113','p3113'),(30,'Sistema IoT para controlo de acessos','2018','','','2022-10-07','2022-10-07','Desenvolvimento e prototipagem de uma fechadura electrónica IoT para salas de aula. \nProfessores e funcionârios poderão abrir a porta com dupla autenticação, utilizando tecnologia RFID e usando um PIN próprio. Ao mesmo tempo que abrem a porta, é feita a marcação da sua presença numa base de dados. Os alunos poderão também marcar a sua presença através de um leitor RFID situado no interior da sala.',NULL,'Atribuido',NULL,'DEISI30','','p5403','p5403'),(300,'BestRide ','2022','','','2022-10-07','2022-10-07','Desenvolvimento de servicos de gestão de plataforma de Gestão de Tuk Tuk. Conceitos: \n1- Um turista pode escolher roteiros de viagens\n2- Um condutor de tuk tuk define roteiros, recebe pagamentos\n3- Plataforma retém fee de comissão\n4- Plataforma Web de gestão de turistas e condutores\n',53,'Publicado',NULL,'DEISI300','','p3113','p3113'),(301,'Plataforma de Monitorização de Impressoras 3D de Construção de Casas','2022','','','2022-10-07','2022-10-07','Plataforma de gestão e monitorização de IoT de Impressoras 3D de construção de casas, usando sensores e arduinos. Projeto no âmbito de parceria com empresa Youcoders, no âmbito do Seed Funding da Universidade Lusófona',55,'Publicado',NULL,'DEISI301','','p3113','p3113'),(302,'Robot Process Automation - Componente 1','2022','','','2022-10-07','2022-10-07','Desenvolvimento de protótipos de tecnologia UiPath, no âmbito do CGI Lab em instalação na Universidade Lusófona e na PLAY.',90,'Publicado',NULL,'DEISI302','','p3113','p3113'),(303,'Robot Process Automation - Componente 2','2022','','','2022-10-07','2022-10-07','Desenvolvimento de protótipos de tecnologia UiPath, no âmbito do CGI Lab em instalação na Universidade Lusófona e na PLAY.',90,'Publicado',NULL,'DEISI303','','p3113','p3113'),(304,'Buddy abroad ','2022','','','2022-10-07','2022-10-07','Fusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de interface app mobile e Web de Gestão de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',53,'Anulado',NULL,'DEISI304','','p3113','p3113'),(305,'Plataforma de Solução de Cibersegurança SIEM baseada em Open Source','2022','','','2022-10-07','2022-10-07','Desenvolvimento e integração de plataformas de cibersegurança num único ambiente integrado, de suporte à deteção de eventos empresariais (redes, aplicações, autenticações, darkweb) baseado em tecnologias open source, que possam garantir uma solução única de serviço a uma empresa.',91,'Publicado',NULL,'DEISI305','','p3113','p3113'),(307,'Sistema para Monitorização de Plantas - Frontend e Backend','2022','','','2022-10-07','2022-10-07','Diversas aplicações têm surgido no âmbito da internet das coisas e no que toca à componente de monitorização do mundo que nos rodeia tal não é excepção. Neste projecto pretende-se implementar uma monitorização de plantas a partir de frontend com backend.',NULL,'Publicado',NULL,'DEISI307','','p6115','p6115'),(308,'ULHT PresCheck - Back-End','2022','','','2022-10-07','2022-10-07','Reconhecendo a dificuldade que os professores possuem atualmente para validar a lista de presenças nas aulas, recorrendo a planilhas e formas próprias de fazer este trabalho, queremos uma solução universal que, com a ajuda de Arduino e outras tecnologias, permita aos professores da faculdade obter a lista dos números dos alunos presentes. Aqui serâ implementado o servidor, base de dados e APIs para gerir a comunicação com os Arduinos e com o front-end.',NULL,'Publicado',NULL,'DEISI308','','p6115','p6115'),(309,'ULHT PresCheck - Front-End','2022','','','2022-10-07','2022-10-07','Reconhecendo a dificuldade que os professores possuem atualmente para validar a lista de presenças nas aulas, recorrendo a planilhas e formas próprias de fazer este trabalho, queremos uma solução universal que, com a ajuda de Arduino e outras tecnologias, permita aos professores da faculdade obter a lista dos números dos alunos presentes. Aqui serâ implementado o front-end com base visual e uso de dados do back-end.',NULL,'Publicado',NULL,'DEISI309','','p6115','p6115'),(31,'Mobile Quiz','2018','','','2022-10-07','2022-10-07','Desenvolver uma aplicação para telemóvel (HTML5 ou Híbrida) para mostrar perguntas de escolha múltipla que seria despoletada pelo professor durante a aula. Os alunos poderão responder de forma anónima ou autenticada e o professor poderâ consultar os resultados em tempo-real no seu computador. Além da aplicação para telemóvel (alunos), serâ necessârio desenvolver uma aplicação web para o professor introduzir as perguntas e consultar os resultados.',NULL,'Atribuido',NULL,'DEISI31','','p4997','p4997'),(313,'ABzz - Plataforma de Modelo Vida Saudàvel','2022','','','2022-10-07','2022-10-07','Projeto de desenvolvimento de prototipo de plataforma de Vida Saudàvel de reservas de eventos, restaurantes e outros.\nObjetivo de criação de ecossistema alternativo.\nPlataforma Mobile App e Web.',95,'Publicado',NULL,'DEISI313','','p3113','p3113'),(314,'Aplicação para gestão de competições de wakeboard - backend + frontend PWA	','2022','','','2022-10-07','2022-10-07','Numa competição de wakeboard, os atletas são distribuídos de acordo com categorias e competem entre si em grupos. Os vencedores de cada grupo passam às fases seguintes até chegarem à final. Este trabalho irâ focar-se no desenvolvimento do backend e no módulo PWA (frontend) para inserção das avaliações dos juízes. ',NULL,'Publicado',NULL,'DEISI314','','p5403','p5403'),(315,'Debugger de software de satélites ','2022','','','10/07/2023','2022-10-07','Presentemente o software que corre num satélite encontra-se a ser executado em cima de sistema operativos \nprópios que garantem um proteção contra vârios erros.\nHoje em dia a depuração de erros neste sistemas operativos é feita de forma simples e limitada em linha de comando.\nNeste TFC o aluno, ira criar uma GUI desse debugger e adicionando funcionalidades de debugging no sistema operativo para ele ser mais avançado. ',NULL,'A Aguardar Atribuição',NULL,'DEISI315','','p6902','p6902'),(316,'Plataforma de voto com aplicação de blockchain e criptografia.','2022','','','2022-10-07','2022-10-07','Desenvolver uma plataforma de voto que torne possível o ato de votar mais simples e ecológico, seja de forma mobile ou nas urnas presencialmente. Mais seguro em relação aos dados com a implementação de criptografia e blockchain.\n\n',NULL,'Publicado',NULL,'DEISI316','','p5905','p5905'),(317,'Plugin DP para alunos - v2','2022','','','2022-10-07','2022-10-07','Pretende-se melhorar um plugin que permite aos alunos interagir com o sistema Drop Project directamente a partir do IDE IntelliJ.\n\nEste projecto jâ estâ atribuído ao aluno BERNARDO BALTAZAR.',NULL,'Publicado',NULL,'DEISI317','','p4453','p4453'),(318,'Sistema para Monitorização de Edifícios','2022','','','2022-10-07','2022-10-07','Neste projecto pretende-se implementar um sistema de monitorização de edifícios usando uma rede Zigbee. Realizar-se-â a medição da temperatura, humidade relativa, luminosidade, nível de gâs, detecção de presença e detecção de inundação através dos respectivos sensores e envio para a plataforma de visualização (PC) com periodicidade pré-definida ou instantânea (quando seleccionado o botão/comando para actualização das medições).',NULL,'Publicado',NULL,'DEISI318','','p5782','p5782'),(32,'Plataforma DEISI - Gestão de turmas','2018','','','2022-10-07','2022-10-07','Desenvolver uma aplicação web para gestão de turmas e horârios, onde os alunos podem pedir a mudança de turma, consultar os horârios das vârias turmas, etc. Esta aplicação serâ integrada na plataforma DEISI (onde reside por exemplo a aplicação de gestão de TFCs). Este TFC deverâ ser desenvolvido em Spring (Java ou Kotlin) e é individual.',NULL,'Atribuido',NULL,'DEISI32','','p4997','p4997'),(321,'Monitorização de viaturas de emergência médica','2022','','','2022-10-07','2022-10-07','Após a chamada para o 112, é dado o despacho de um meio para auxiliar essa vítima. O tempo que a vítima aguarda por auxílio é fundamental para recuperação da vítima. Neste projeto pretende-se apresentar a localização, em mapa, das viaturas e vítimas assim como a sugestão do caminho ótimo que deverâ ser percorrido. Co-orientação: Iolanda Velho',97,'Publicado',NULL,'DEISI321','','p6301','p6301'),(324,'Automação de testes para Robotic Process Automation','2022','','','2022-10-07','2022-10-07','Desenvolvimento de uma solução para automação de testes de Robotic Process Automation (RPA).\nO objetivo é testar as peças de software desenvolvidas com a finalidade de verificar se cumprem com os requisitos pré-determinados para o seu desenvolvimento, validar a sua qualidade para permitir a passagem a produção.\nNuma fase produtiva controlar a execução dos RPA no dia-a-dia.',90,'Publicado',NULL,'DEISI324','','p6255','p6255'),(326,'Dashboard de mobilidade','2022','','','2022-10-07','2022-10-07','Desenvolver uma aplicação web que apresente um dashboard de mobilidade na ârea dos transportes públicos, permitindo a visualização de dados sobre mobilidade. Envolverâ interação com base de dados, e utilização de ferramentas de ciências de dados para processamento e criação de resultados e criação de grâficos. Co-orientadora: Prof. Iolanda Velho',NULL,'Publicado',NULL,'DEISI326','','p6069','p6069'),(327,'Uber de transporte de mercadorias','2022','','','2022-10-07','2022-10-07','Pretende-se a criação de uma aplicação mobile que permita a contratação temporâria de transportadores de mercadorias para trabalhos exporâdicos ao estilo Uber.',NULL,'Publicado',NULL,'DEISI327','','p5932','p5932'),(329,'Therapist Screen','2022','','','2022-10-07','2022-10-07','The Therapist Screen is a component for a therapy application in VR using the Unity game engine. It will allow the creation of user profiles and saving player metrics and settings on these profiles. Alongside this system, the student will develop an interface that is to be displayed in the moderating therapistâ€™s screen, where they will be able to access player metrics and edit game settings - with these values being saved to the player profile currently in session.',102,'A Aguardar Atribuição',NULL,'DEISI329','','p5441','p5441'),(330,'Aplicação de Machine Learning para apoio à decisão na gestão hospitalar','2022','','','2022-10-07','2022-10-07','O Centro de Medicina de Reabilitação de Alcoitão, referência de Excelência internacional, lida com questões generalizadas quanto à gestão de recursos. A anâlise de dados é crucial para apoiar na decisão e optimização destes.\nO aluno, neste projecto, deve tratar e avaliar os dados de forma a desenvolver um modelo que prevê a procura dos serviços de internamento e/ou ambulatório. Com os resultados, pretende-se melhorar a resposta do atendimento ao utente. Co-orientação da Prof. Maria Silva.\n',100,'Publicado',NULL,'DEISI330','','p6949','p6949'),(331,' Aplicação móvel para tele-reabilitação de pacientes com dificuldades motoras/neurológicas','2022','','','2022-10-07','2022-10-07','Em estreita colaboração com o Centro de Medicina de Reabilitação de Alcoitão (Santa Casa da Misericórdia de Lisboa), pretende-se desenvolver uma aplicação móvel que permita a pacientes com dificuldades motoras e/ou neurológicas realizar exercícios de reabilitação em casa, com acompanhamento remoto do corpo clínico. Inclui recolha de informação da evolução do paciente que serâ guardada numa Base de Dados para posterior anâlise estatística. Este trabalho serâ co-orientado pelo Prof. Pedro Alves.\n',100,'Publicado',NULL,'DEISI331','','p6476','p6476'),(333,'CVTool - Front end','2022','','','2022-10-07','2022-10-07','Solução permite registar de forma manual toda a informação de um CV.\nA informação deve ser estruturada e otimizada de forma a permitir buscas por critérios tão diferentes como experiência, competências, certificados, etc. De seguida pretende-se que ao receber um CV o mesmo possa ser processado automaticamente \nFuncionalmente além das buscas, dashboards sobre os perfis guardados, trabalhar dados guardados a geração de um CV com base num formato/template pré-definido.',90,'Publicado',NULL,'DEISI333','','p6255','p6255'),(334,'CVTool - Back-end','2022','','','2022-10-07','2022-10-07','Solução permite registar de forma manual toda a informação de um CV.\nA informação deve ser estruturada e otimizada de forma a permitir buscas por critérios tão diferentes como experiência, competências, certificados, etc. De seguida pretende-se que ao receber um CV o mesmo possa ser processado automaticamente \nFuncionalmente além das buscas, dashboards sobre os perfis guardados, trabalhar dados guardados a geração de um CV com base num formato/template pré-definido.',90,'Publicado',NULL,'DEISI334','','p6255','p6255'),(335,'CGI Ambassadors','2022','','','2022-10-07','2022-10-07','Solução que permita interligar embaixadores de organizações, e que em função de iniciativas e objetivos permita recompensar os mesmos através de pontos e aplicar conceitos de gamificação. Eventos que geram pontos que têm de ter aprovação.\nOs rankings deverão poder ser vistos por curso, ano, universidade ou global. A solução deverâ também permitir atribuir desafios específicos aos embaixadores, dependendo da universidade, curso ou ano ou serem gerais para todos os embaixadores.  ',90,'Publicado',NULL,'DEISI335','','p6255','p6255'),(336,'CVTool - CV Capture data','2022','','','2022-10-07','2022-10-07','Solução permite transformar toda a informação de um CV, de uma estruturada e otimizada e integrar a solução de registo e pesquisa de  CVs.\nFuncionalmente além das buscas, dashboards sobre os perfis guardados, trabalhar dados guardados a geração de um CV com base num formato/template pré-definido.',90,'Publicado',NULL,'DEISI336','','p6255','p6255'),(337,'One to One Spatial Translation vs Constrained Spaces: A study in locomotion and Cybersickness','2022','','','2022-10-07','2022-10-07','One of the biggest challenges in VR is the conflict between the sense of movement and the lack thereof, leading to cybersickness and its symptoms (headaches, nausea, vertigo, or eyestrain). This work aims to compare this phenomenon to a one-to-one representation of the spatial navigation map, where the virtual space is directly mapped to the physical space. The goal is to observe if the physical movement can mitigate cybersickness or if other factors are at play (e.g., sampling rate or FoV).',101,'Publicado',NULL,'DEISI337','','p5441','p5441'),(338,'Mapping Physical Interaction with Virtual: a study on Haptics, Physical and Virtual Movement','2022','','','2022-10-07','2022-10-07','VR interaction has limitations because no physical object or mass is present when interacting with Virtual Objects. This study intends to map virtual interaction with an actual physical object to understand if users feel a higher sense of immersion than traditional VR manipulation. The goal is to incorporate hand-tracking and motion capture techniques with VR with the purpose of constructing a one-to-one mapping between the physical and virtual interaction, such as opening a door.',101,'Publicado',NULL,'DEISI338','','p5441','p5441'),(339,'Numerical Performance of Scientific Programming Languages','2022','','','2022-10-07','2022-10-07','This project aims to compare the numerical performance of five scientific programming languages/environments â€“ Python/NumPy, R, MATLAB, Octave and Julia â€“ under different operating systems â€“ Linux, Mac, Windows â€“ and hardware â€“ single core and multicore CPUs. The software to be used for this purpose is already implemented in all the languages, consisting of a synthetic cluster generator. Results of this study aim to inform the scientific community of the pros and cons of the tested languages.',NULL,'Publicado',NULL,'DEISI339','','p5441','p5441'),(34,'Content Marketplace platform - Desenho Processos e Arquitetura','2018','','','2022-10-07','2022-10-07','Pretende-se desenhar e desenvolver os vârios processos e a arquitetura de uma plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, ebooks, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. ',14,'Atribuido',NULL,'DEISI34','','p3113','p3113'),(340,'Landscaper Ants','2022','','','2022-10-07','2022-10-07','This project aims to study the use of optimization algorithms such as Ant Colony Optimization, Artificial Bee Colony, Bat Algorithm and other nature-inspired algorithms to procedurally generate artificial landscapes similar to what one would find in real-life natural and man-made locations. A preliminary work employing Particle Swarm Optimization is available at https://www.mdpi.com/1099-4300/22/11/1284 (check the link to the vídeos).',NULL,'A Aguardar Atribuição',NULL,'DEISI340','','p5441','p5441'),(341,'Aplicação de Inteligência Artificial para estudo de prâtica clínica inovadora','2022','','','2022-10-07','2022-10-07','Em parceria com o Centro de Medicina de Reabilitação de Alcoitão, referência de Excelência internacional, propomos uma anâlise e aplicação de inteligência artificial para dados de um tratamento clínico inovador. O estudo dos dados resultantes da aplicação da Toxina Botulínica para lesões do sistema nervoso central permitirâ conhecimento, até então por explorar, para suporte clínico e apoio à decisão . Co-orientação da Prof. Maria Silva.',100,'Publicado',NULL,'DEISI341','','p6949','p6949'),(343,'Deteção e mitigação/correção de doenças oculares','2022','','p6115','2022-10-07','2022-10-07','Criação de solução tecnológica que facilite a deteção, diagnóstico e/ou correção/mitigação de doenças oculares. O Objetivo é fazer evoluir os processos de deteção e diagnóstico ou, em determinados casos o suporte das novas tecnologias à mitigação e correção de algumas dessas doenças.\n',104,'Publicado',NULL,'DEISI343','','p5403','p5403'),(345,'Estudo das chamadas de emergência realizadas','2022','','','2022-10-07','2022-10-07','Este TFC tem como objetivo analisar as chamadas que são realizadas para o 112, de forma a poder-se perceber alguma da sua casuística que poderão ser utilizadas na implementação de ações de otimização dos recursos. \nCo-orientação: Iolanda Velho',97,'Publicado',NULL,'DEISI345','','p6301','p6301'),(35,'Sistema de Alarme por Geofencing','2018','','','2022-10-07','2022-10-07','Sistema IoT de alarme por geofencing baseado em gps utilizando protocolo MQTT. Desenvolvimento de uma webapp para localizaçao e monitorização dos alarmes.\nDesenvolvimento de uma aplicação servidor para manter as areas de controlo (GPSFences), o registo dos equipamentos, e os dados de histórico dos alarmes. Prototipagem de um equipamento (ou aplicação móvel) com GPS e módulo GPRS  para ser instalado no objecto ou pessoa a controlar.',NULL,'Atribuido',NULL,'DEISI35','','p5403','p5403'),(350,'Add On PHC: Gestão escolar','2022','','','2022-10-07','2022-10-07','Pretende-se devolver Add-on de gestão escolar para o ERP PHC\nO desenvolvimento poderâ incluir, entre outros, gestão de aluno, docentes, turmas, horârios, espaços, facturação e vencimentos',105,'Publicado',NULL,'DEISI350','','p2703','p2703'),(351,'Add On PHC: exportação para Excel','2022','','','2022-10-07','2022-10-07','Desenvolver objectos de exportação do ERP PHC-Go e add-in complementares em Excel de modo a permitir anâlise de dados na ferramenta da Microsoft',105,'Publicado',NULL,'DEISI351','','p2703','p2703'),(352,'Add On PHC: Messaging','2022','','','2022-10-07','2022-10-07','Desenvolver modulo de comunicação com SMS, Instant messaging e redes sociais para o ERP PHC-Go\nPretende-se que o ERP possa enviar mensagens, para entidades externas ou utilizadores, utilizando as ferramentas e recursos mais recentes (SMS, messenger, whatsapp, etc.)',105,'Publicado',NULL,'DEISI352','','p2703','p2703'),(354,'Aplicação MentHA','2022','','','2022-10-07','2022-10-07','O projeto MentHA - Mental Health and Aging (https://mentha-digital.herokuapp.com/) visa o treino cognitivo de adultos mais velhos com demência. Pretende-se continuar o desenvolvimento das aplicações desenvolvidas em TFCs anteriores. O trabalho irâ consistir na integração de novas funcionalidades, acompanhamento da sua aplicação nos parceiros do projeto (Cruz Vermelha Portuguesa, FamiliarMente,Elo Social,ASMAL,ADEB,GIRA) e introdução de melhorias sugeridas. Trabalho jâ atribuido.',88,'Publicado',NULL,'DEISI354','','p6069','p6069'),(355,'TASTE um IDE para Software de Satelites','2022','','','14/09/2023','10/07/2023','A Agência Espacial Europeia (ESA) tem desenvolvido um Ambiente de Desenvolvimento Integrado (IDE) para software espacial, que suporta programação em Ada, C, SDL, Matlab/Simulink e outras linguagens. Este IDE chama-se TASTE (https://taste.tools/).\n\nNeste TFC, os alunos irão adicionar melhorias ao IDE, nomeadamente aumentar o seu suporte para o desenvolvimento de vârias aplicações em simultâneo, e criando uma GUI própria para esse fim.',109,'A Aguardar Atribuição',NULL,'DEISI355','','p6902','p6902'),(356,'Modelo IA para codigo seguindo standard MISRA','2022','','','10/07/2023','10/07/2023','O MISRA (Motor Industry Software Reliability Association) é uma associação que estabelece diretrizes e melhores prâticas para o desenvolvimento de software na indústria automotiva e em outros setores que requerem alta confiabilidade e segurança. MISRA C é o standard para desenvolver software em C.\nO aluno é convidado a fazer uma modelo IA que analisa codigo C, e consegue o corrigir para ficar em linha com o MISRA.',17,'A Aguardar Atribuição',NULL,'DEISI356','','p6902','p6902'),(358,'Plugin DP para Professores','2022','','','06/09/2023','06/09/2023','Pretende-se melhorar um plugin que permite aos professores interagir com o sistema Drop Project directamente a partir do IDE IntelliJ.\n\nEste projecto jâ estâ atribuído ao aluno João Marques.\n',NULL,'A Aguardar Atribuição',NULL,'DEISI358','','p4453','p4453'),(359,'Tratamento audio- podcasts','2022','','','13/09/2023','13/09/2023','Projeto numa linguagem adequada em Smart ou PC \n1ª parte - aceitação de um file audio (mp3, aac, wav...) com discurso; utilização das ferramentas google (speech e translate) para sacar a transcrição gerando-se um ficheiro de texto - *.srt.\n2ª parte - colocação em BD na nuvem do material recolhido: links para os files audio e ficheiro *.srt; app para tratamento desses dados: pesquisa, filtragem, etc. sobre palavras chave (nomes, anos, fontes...).\nhttps://www.youtube.com/watch?v=AyzmS5WeIx4\n',NULL,'A Aguardar Atribuição',NULL,'DEISI359','','p1059','p1059'),(360,'Gestão de Acessos - Academia Cristiano Ronaldo','2022','','','13/09/2023','13/09/2023','Pretende-se criação uma aplicação móvel para gestão de entradas e saídas dos atletas residentes na Academia Cristiano Ronaldo (Sporting Clube de Portugal). \nAtualmente os atletas têm que preencher um formulârio (em papel) solicitando a saída da Academia num determinado espaço temporal. Este formulârio é depois entregue aos responsâveis pelos atletas, que posteriormente aprovam, ou não, a sua saída. O objetivo deste trabalho é que todo este processo fosse automatizado.',108,'A Aguardar Atribuição',NULL,'DEISI360','','p5958','p5958'),(361,'Continuous Integration Template for Qualified/Certified Projects','2022','','','14/09/2023','14/09/2023','Os projectos desenvolvidos em aeronautica e espaço são validados sob standards e testes bastantes estritos.\nExiste a possibilidade que quando se inicia um novo project nesta area, criar em github ou gitlab um processo CI por defeito que valida automaticamente o software produzido contra esses standards.\nO aluno iria criar esse CI, que chamaria certos ferramentas de validacao e criar uma pequena demonstração.',17,'A Aguardar Atribuição',NULL,'DEISI361','','p6902','p6902'),(362,'Configurador Grafico de XML e Gerador de Código Aviónico','2022','','','14/09/2023','14/09/2023','Na area de avionica a configuração de software é descrita no formato XML. Dai é possive gerar esqueleto da aplicação. Neste TFC o aluno ira permitir o entendimento facil da descrição feita em XML, mostrando de uma forma gráfica e simples. Assim o programador consegue facilmente ver erros da configuração e gerar sem problemas o código respectivo.',NULL,'A Aguardar Atribuição',NULL,'DEISI362','','p6902','p6902'),(363,'Business Continuity Assessment Tool','2022','','','19/09/2023','19/09/2023','Software para avaliar o grau de maturidade de uma organização em termos de Continuidade do Negócio.\nAo iniciar um programa de  Capacidade de Continuidade Organizacional, esta ferramenta examina se a organização abordou os elementos fundamentais de um programa de continuidade para permitir o planeamento das operações de continuidade de negócio. Esta app serâ para avaliar um plano e programa de continuidade em relação aos requisitos para um programa e plano de continuidade viâvel.',NULL,'A Aguardar Atribuição',NULL,'DEISI363','','p6255','p6255'),(364,'GPT ArgMine','2022','','','09/10/2023','09/10/2023','Este trabalho final de curso tem como foco o uso de técnicas de aprendizagem de mâquina em conjunto com o ChatGPT para extrair argumentos em conversas de grupo entre estudantes no ensino secundârio. O objetivo é desenvolver um sistema capaz de classificar argumentos em conversas educativas. Ao analisar e entender os argumentos apresentados em tais conversas, este projeto visa fornecer insights valiosos sobre a dinâmica e eficâcia da colaboração estudantil em ambientes de aprendizagem online.',NULL,'A Aguardar Atribuição',NULL,'DEISI364','','p5265','p5265'),(365,'ALQI-DR: tutor inteligente para estudar interações mediadas por algoritmos.','2022','','','09/10/2023','09/10/2023','O projeto pretende implementar p cérebro de um tutor inteligente que funciona como um agregador interativo de notícias . Esta ferramenta educacional não apenas serve como uma plataforma para disseminação de notícias, mas também oferece uma oportunidade única para examinar de perto as interações e comportamentos de jovens indivíduos dentro desses ecossistemas de informações algorítmicas.',NULL,'A Aguardar Atribuição',NULL,'DEISI365','','p5265','p5265'),(37,'Aplicação de Gestão Portfolio Aplicacional','2018','','','2022-10-07','2022-10-07','O objetivo deste trabalho é desenvolver uma aplicação que permita fazer o registo e controlo das aplicações em utilização, em implementação e planeadas e definir métricas para classificar as mesmas.\nDeverâ ser permitido tipificar os perfis de utilizadores e definir as aplicações que cada perfil necessita.\nDeverão ser disponibilizados alertas e relatórios agregados pelas métricas implementadas.',NULL,'Atribuido',NULL,'DEISI37','','p2','p2'),(38,'Protótipo de Gestão de Arquitetura Empresarial, Gestão de Projecto e Gestão de Portfólio Aplicacional.','2018','','','2022-10-07','2022-10-07','Pretende-se com este trabalho desenvolver um protótipo que permita gerir e controlar o Plano de ação resultante de um projeto de Arquitetura Empresarial, Projetos em curso e o Portfólio Aplicacional de uma empresa',NULL,'Indisponivel',NULL,'DEISI38','','p2','p2'),(39,'Elaboração da Arquitetura Empresarial (Sistemas de Informação) para uma empresa baseada no Framework de Zachman','2018','','','2022-10-07','2022-10-07',' Pretende-se com este trabalho efetuar um projeto de arquitetura empresarial de uma empresa utilizando como referência a Framework de Zachman e utilizando uma ferramenta de modelação de processos, preferencialmente o Powerdesigner 16.0 ou posterior. Deverão ser identificadas âreas de melhoria e ações a desenvolver (Plano de ação).               ',NULL,'Atribuido',NULL,'DEISI39','','p2','p2'),(40,'Arquitetura Empresarial, Gestão de Projecto e Gestão de Portfólio como estratégia','2018','','','2022-10-07','2022-10-07','Existem muitos exemplos de empresas que obtiveram sucesso ou papel de destaque nos seus segmentos de mercado com a adoção e implementação de uma arquitetura empresarial. Pretende-se com este trabalho desenvolver um protótipo, incluindo definição e representação do processo.',NULL,'Indisponivel',NULL,'DEISI40','','p2','p2'),(41,'Gestão de portfólio aplicacional (EPM â€“ Enterprise Portfolio Management), Protótipo e Oferta Comercial','2018','','','2022-10-07','2022-10-07','Hoje em dia é cada vez mais importante nas empresas ter um alinhamento total entre a estratégia e as aplicações de suporte ao negócio. Para tal uma Gestão do portfólio aplicacional eficaz é fundamental para garantir da eficâcia das aplicações empresariais, alinhamento com a estratégia e processos empresariais e proteção ao investimento. \nPretende-se com este trabalho elaborar um protótipo, e efectuar uma anâlise comparativa da oferta comercial existente no mercado.',NULL,'Atribuido',NULL,'DEISI41','','p2','p2'),(42,'Liga dos Ãšltimos','2018','','','2022-10-07','2022-10-07','Criação de um website/ mobile que apresenta os resultados classificativos das piores equipas de determinados desportos, por categorias e estatísticas, com base em serviços online.',16,'Atribuido',NULL,'DEISI42','','p3478','p3478'),(46,'Compilação, Verificação e Validação contínua de software de Espaço','2018','','','2022-10-07','2022-10-07','A Agencia Espacial Europeia tem a decorrer um conjunto de missões (e.g. \"Space Rider\"), em que a GMV é responsâvel pelo software de bordo.  Todo software executado no espaço é submetido a um processo de \"qualificação\" que consiste num conjunto de normas e testes que garantem o seu funcionamento. Neste TFC é proposto a automatização parcial do processo de qualificação implementando uma rotina, que, por ex., todas as noites, corre um conjunto de testes sobre o software armazenado num repositório.',17,'Indisponivel',NULL,'DEISI46','','p5403','p5403'),(5,'Content-Based Music Information Retrieval','2018','','','2022-10-07','2022-10-07','Apresentar uma solução algorítmica e metodológica para problemas de recuperação de informação musical baseada em conteúdo, e outras sugestões (por exemplo, notação musical e representação simbólica) e/ ou espectro de especificidade de similaridade de âudio.',1,'Indisponivel',NULL,'DEISI5','','p3478','p3478'),(50,'Gestão de Plataforma de Field Service - Módulo I','2018','','','2022-10-07','2022-10-07','Reformulação de plataforma de gestão de entregas e serviços.',14,'Atribuido',NULL,'DEISI50','','p3113','p3113'),(51,'Gestão de Plataforma de Field Service - Módulo II','2018','','','2022-10-07','2022-10-07','Desenvolvimento de plataforma mobile de plataforma de gestão de serviços',14,'Atribuido',NULL,'DEISI51','','p3113','p3113'),(6,'Serious Game','2018','','','2022-10-07','2022-10-07','Pretende-se explorar a conceção e desenvolvimento de jogos sérios para a aprendizagem ao longo da vida, formação profissional ou em contexto das redes colaborativas.',2,'Indisponivel',NULL,'DEISI6','','p3478','p3478'),(66,'Plataforma DEISI - Gestão de TFCs (II)','2018','','','2022-10-07','2022-10-07','Continuar o trabalho jâ desenvolvido na plataforma de gestão de TFCs para incluir novas funcionalidades: upload dos relatórios e outros artefactos; agendamento das apresentações intermédias e finais; registo das avaliações intermédias e finais; notificações; etc. A aplicação foi desenvolvida em Java usando a framework Spring. O objectivo é integrar as novas funcionalidades jâ no próximo semestre. Este trabalho é para ser desenvolvido por um aluno.',NULL,'Atribuido',NULL,'DEISI66','','p4997','p4997'),(7,'Gaming out of Depression','2018','','','2022-10-07','2022-10-07','Gaming out of Depression é uma comunidade destinada a ajudar pessoas com vârias formas de depressão com um interesse em comum: video-jogos. O objetivo é desenvolver uma plataforma que permita que os membros façam login e encontrem facilmente outros que possam jogar, bem como membros com os quais eles possam conversar. Não existe atualmente qualquer software no mercado que atenda às necessidades de pessoas que sofrem de vârias formas de depressão.',2,'Atribuido',NULL,'DEISI7','','p3478','p3478'),(70,'Utilização de chaves criptogrâficas em TEE (Trusted Execution Environment)','2018','','','2022-10-07','2022-10-07','Um método predominante e comprovado para lidar com informações confidenciais e reduzir os pontos de ataque nos dispositivos é o Trusted Execution Environment (TEE) que consiste em criar uma ârea separada na unidade central de processamento. Este trabalho pretende explorar soluções de código aberto que permitem implementar o TEE, tais como o OP-TEE e GzOS e avaliar a capacidade em proteger particularmente chaves criptogrâficas de serem copiadas. ',NULL,'Atribuido',NULL,'DEISI70','','p3025','p3025'),(71,'Plataforma de aluguer de filmes','2018','','','2022-10-07','2022-10-07','Plataforma de registo de aluguer de filmes que usa Distributed Ledger technology para registo de transacções. ',NULL,'Indisponivel',NULL,'DEISI71','','p5404','p5404'),(73,'Simulação multi-agente comparativa da difusão de inovações e noticias falsas.','2018','','','2022-10-07','2022-10-07','O objetivo central deste trabalho é replicar um estudo anterior que utiliza um modelo multi-agente para identificar processos coletivos relevantes a propagação e assimilação de inovações numa rede social. Apos a replicação do estudo, incluindo a implementação do respetivo sistema de simulação multi-agente os alunos vão adaptar o sistema para similar propagação de noticias falsas.',NULL,'Atribuido',NULL,'DEISI73','','p5265','p5265'),(75,'Plataforma Gestão de Requisitos','2019','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação de gestão de ciclo de vida de requisitos utilizando abordagens SCRUM e AGSI-Arquitectura da Gestão de Sistemas de Informação e descrição de requisitos em template a fornecer por orientador\nTrabalho enquadra-se em projecto mais amplo, visando a integração com ferramentas de gestão de projecto (e.g.: MS-Project) e de controlo de versões (e.g.: git) \nDisciplinas listadas não são de obrigatoriedade cumulativa; As tecnologias indicadas são alternativas',NULL,'Publicado',NULL,'DEISI75','','p2703','p2703'),(76,'Geoplacement (controlo de presença electrónico)','2019','','','2022-10-07','2022-10-07','Solução de validação de presença e acesso a espaços controlados utilizando dispositivos de comunicação moveis pessoais. \nComposta por 3 elementos:\n1. Marcador físico colocado no local onde se controla presença e acesso (alternativa com emissor Beacon);\n2. Aplicação móvel para ler o marcador/emissor e registar leitura em base de dados central, após validar  geolocalização.\n3.Backoffice de controlo de registos e utilizadores \nComponente móvel em android',NULL,'Publicado',NULL,'DEISI76','','p2703','p2703'),(77,'Plataforma de subscrição de serviços','2019','','','2022-10-07','2022-10-07','Construção de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrição de serviços, disponibilizados em formato de partilha de tempo  e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes.\nO presente TFC tem por objecto definir o modelo conceptual para o Ecossistema e a construção de um PoC, em formato de protótipo funcional,  para validação do mesmo.',NULL,'Publicado',NULL,'DEISI77','','p2703','p2703'),(79,'PROPOSTA RETIRADA POR INDISPONIBILIDADE DE ORIENTACÃO','2019','','','2022-10-07','2022-10-07','Desenvolver interface de avaliação para SAD-RH, de acordo com critérios e métricas de avaliação definidas pela DRH.\nA interface integra com ERP de Gestão de RH para identificação de funcionârios e interacção com histórico de avaliações, mas tem autonomia para validação de preenchimento\nConstrução da solução implica desenvolvimento de API, em formato Web Service, para integração com ERP\nAutenticação OAuth com plataforma Google',5,'A Aguardar Atribuição',NULL,'DEISI79','','p2703','p2703'),(8,'Plataforma com incentivos e prémios','2018','','','2022-10-07','2022-10-07','Modelos de redes de negócios de colaboração e marketing, em redes ativas com incentivos e prémios.',3,'Atribuido',NULL,'DEISI8','','p3478','p3478'),(80,'Carlos Relvas: Catâlogo Estereoscópico','2019','','','2022-10-07','2022-10-07','O projecto de investigação Carlos Relvas Full 3D. The Stereo Catalogue (CICANT- ULHT) estâ a criar um catâlogo\ndigital online para apresentar as fotografias estereoscópicas de Carlos Relvas.\n',31,'Nao Atribuido',NULL,'DEISI80','','p5404','p5404'),(83,'Plataforma DEISI - Gestão de TFCs (Desenvolvimento)','2019','','','2022-10-07','2022-10-07','Continuar o trabalho jâ desenvolvido na plataforma de gestão de TFCs para corrigir bugs entretanto detetados e incluir novas funcionalidades a serem discutidas no início do projecto. A aplicação foi desenvolvida em Java usando a framework Spring. O objectivo é integrar as novas funcionalidades jâ no próximo semestre. Este trabalho é para ser desenvolvido por um grupo de 2 alunos.',NULL,'Publicado',NULL,'DEISI83','','p4997','p4997'),(84,'Plataforma DEISI - Gestão de TFCs (Anâlise e Testes)','2019','','','2022-10-07','2022-10-07','Este projecto serâ complementar ao TFC DEISI83 (\"Plataforma DEISI - Gestão de TFCs (Desenvolvimento)\") sendo mais vocacionado para a anâlise de requisitos com o objectivo de criar uma bateria de testes exaustivos, usando JUnit e outras frameworks relevantes, assim como testes de usabilidade e desempenho. Este trabalho é para ser desenvolvido por um grupo de 2 alunos.',NULL,'Publicado',NULL,'DEISI84','','p4997','p4997'),(85,'PROPOSTA RETIRADA POR INDISPONIBILIDADE DE ORIENTACÃO','2019','','','2022-10-07','2022-10-07','A solução a criar deverâ permitir a um utilizador não conhecedor da linguagem SQL criar relatórios a partir de um base de dados a que lhe seja dado acesso, podendo imprimi-los ou exporta-los para ficheiro externo O TFC continua trabalho anterior que jâ executa queries elementares com SGBD MS-SQL e MySQL, com exportação em formato MS-Excel e XML Nesta fase, pretende-se desenvolver interface grâfico, aprofundar construção de queries, permitir impressão e acrescentar o SGBD PostgreSQL',NULL,'A Aguardar Atribuição',NULL,'DEISI85','','p2703','p2703'),(86,'fechadura inteligente','2019','','','2022-10-07','2022-10-07','Desenvolvimento de fechadura digital inteligente com abertura em 2 passos.\nProjecto desenvolvido com Raspbery Pi (fechadura) e Android (chave)\nFechadura com ecrã tâctil gera QR lido pelo Android. O QR é enviado para o Raspberry que devolve PIN. o utilizador deve inserir o PIN no ecrã da Fechadura\nHardware (Raspberry) disponibilizado',NULL,'Publicado',NULL,'DEISI86','','p2703','p2703'),(89,'Aplicação móvel para acesso ao Open edX (cursos online)','2019','','','2022-10-07','2022-10-07','A Lusófona estâ a preparar-se para disponibilizar cursos online através da plataforma Open edX, mas esta plataforma não disponibiliza aplicações nativas para Android e iOS. Pretende-se que os alunos desenvolvam estas aplicações tendo em conta a documentação e código disponibilizados pela plataforma. Este trabalho deverâ ser feito em grupos de 2 alunos, em que pelo menos um dos alunos deverâ ter um macbook (para poder desenvolver a app iOS). O trabalho serâ co-orientado pelo Miguel Tavares.',NULL,'Publicado',NULL,'DEISI89','','p4997','p4997'),(9,'Plataforma de LMS/LCMS','2018','','','2022-10-07','2022-10-07','Plataforma de LMS/LCMS, com eventuais novas funcionalidades que podem passar pela aplicação e desenvolvimento de modelos de negócio eBusiness/ eCommerce, tecnologias de eLearning aplicadas: SCORM, Badges, etc.',2,'Indisponivel',NULL,'DEISI9','','p3478','p3478'),(90,'Content Marketplace platform','2019','','','2022-10-07','2022-10-07','Pretende-se desenvolver uma plataforma de gestão entre jornalistas, redatores e outros produtores de conteúdos (artigos, ebooks, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilização de conteúdos sobre as suas temâticas, produtos ou serviços. Esta plataforma deverâ posteriormente ter funcionalidades como depois de um determinado conteúdo de redes sociais ser aprovado, disseminar diretamente em vârias redes sociais.',11,'Publicado',NULL,'DEISI90','','p3113','p3113'),(91,'Buddy abroad ','2019','','','2022-10-07','2022-10-07','(continuação de protótipo de TFC 2018-19)\nFusão de Tinder +Uber para Guias Turisticos\nDesenvolvimento de plataforma para a criação de novo modelo de guias turísticos. Conceitos: \n1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; \n2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos turísticos do guia, tal como o Tinder faz a junção de pessoas com os mesmos gostos',12,'Publicado',NULL,'DEISI91','','p3113','p3113'),(92,'Portal Empresarial de Conteúdos e CRM Integrado','2019','','','2022-10-07','2022-10-07','Desenvolvimento de Plataforma de Conteúdos para empresa em WordPress, com integração de Módulo de Gestão de Clientes OpenSource (a definir entre SuiteCRM e Odoo) e de Marketing (extensão e integração com Mailchimp ou outro a definir).',32,'Publicado',NULL,'DEISI92','','p3113','p3113'),(93,'Plataforma de Gestão de Identidades e Acessos','2019','','','2022-10-07','2022-10-07','Criação de protótipo de plataforma de Gestão de Identidades e Acessos, baseado em Open Source, com anâlise de vantagens e desvantagens entre OpenIAM, Shibboleth, WSO2 Identity Server, MidPoint, Soffid, Apache Syncope, Gluu.\nObjetivo demonstrar integração e controlo de acessos  com um CRM, um Active Directory, um Gestor de Conteúdos, etc.',NULL,'Publicado',NULL,'DEISI93','','p3113','p3113'),(95,'Sistema de gestão de produtos com ligação ao InvoiceExpress','2019','','','2022-10-07','2022-10-07','Neste projecto pretende-se desenvolver uma plataforma (Web Application) para gerir produtos compostos (criar produtos novos a partir de produtos jâ existentes - matérias primas). A plataforma, desenvolvida usando a framework DJANGO, deverâ permitir a venda e aquisição de produtos. Para isso deverâ integrar a API de facturação do InvoiceExpress. A plataforma deverâ ter também uma base de dados de clientes e fornecedores e permitir listar todas as operações de cada cliente e fornecedor. ',NULL,'Publicado',NULL,'DEISI95','','p5403','p5403'),(96,'Expansão de uma plataforma de automatic assessment tool (AAT)','2019','','','2022-10-07','2022-10-07','Neste TFC pretende-se adicionar algumas funcionalidades a uma plataforma de \"automatic assessment tool\" desenvolvida em django. A plataforma corre conjuntos de testes sobre os trabalhos dos alunos e atribui uma classificação. De momento a plataforma apenas aceita submissões em grupo de trabalhos em linguagem de programação C. Pretende-se expandir a capacidade da plataforma para: aceitar submissões individuais; permitir outras linguagens de programação; correr testes unitârios.',NULL,'Publicado',NULL,'DEISI96','','p5403','p5403'),(97,'Sistema de gestão de uma escola de actividades nauticas','2019','','','2022-10-07','2022-10-07','A Wakevilla LDA é uma escola de actividades nauticas que fornece também alojamento. Neste TFC pretende-se desenvolver um sistema para gestão de clientes, reservas, e registo de actividades. O desenvolvimento serâ feito na framework django.',33,'Publicado',NULL,'DEISI97','','p5403','p5403'),(98,'Aprendizagem baseada em jogos','2019','','','2022-10-07','2022-10-07','Pretende-se explorar a conceção e desenvolvimento de jogos (gamifcation) para a aprendizagem ao longo da vida, formação profissional ou em contexto das redes colaborativas. O tema, plataforma (web, mobile ou desktop), tecnologias e as funcionalidades dos jogos/ recursos deverão ser definidos juntamente com o orientador.',34,'Publicado',NULL,'DEISI98','','p3478','p3478'),(99,'Redes de negócios de colaboração e marketing que motivam com incentivos e prémios','2019','','','2022-10-07','2022-10-07','Modelos de redes de negócios de colaboração e marketing, em redes ativas com incentivos e prémios. As plataformas (web, mobile ou desktop), tecnologias e as funcionalidades deverão ser definidos juntamente com o orientador.',35,'Publicado',NULL,'DEISI99','','p3478','p3478'),(108,'Criar um programa que faça a integração entre o CRM Pipedrive e a ferramenta de facturação Invoicexpress','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','O objectivo do trabalho é criar um programa que faça a integração entre o CRM Pipedrive e a ferramenta de facturação Invoicexpress. Esta ferramenta vai consumir os dados às APIs públicas da Pipedrive e permitir criar facturas na ferramenta de facturação, agilizando assim o trabalho de extração de informação de uma plataforma para a outra. \nPretende-se com este trabalho a integração entre duas ferramentas,  autenticação e transporte de dados. \n\nEste TFC jâ estâ atribuído ao aluno NÂº21705356.',39,'Publicado',NULL,'Empresa108','Orientador poderâ ser alterado no processo de atribuição de TFC','p3113','emp39'),(113,'Robot-Parte 1: Estrutura e Movimento','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','O robô deve ter por 100 a 120 cm, base estâvel (baixo centro de massa) e ser capaz de se movimentar pelo chão, em todas as direções, com o uso de rodas.  As rodas devem ter diâmetro que permitam ultrapassar pequenos obstâculo no chão (p.e.: caricas) sem afetar a estabilidade do conjunto. Sobre essa base-robô serâ colocado o \"corpo\" humanóide do robô com outras partes de hardware (p.e.: câmera, microfone, colunas, etc.).  	Serâ necessârio criar uma API para que um computador remoto possa interagir/controlar o robô. 	Ex.: https://wowwee.com/products/robots',40,'Publicado',NULL,'Empresa113','Orientador poderâ ser alterado no processo de atribuição de TFC','p2703','emp40'),(114,'Robot-Parte 2: Interacção e Comunicação','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','O robô deve ter por 100 a 120 cm, base estâvel (baixo centro de massa) e ser capaz de se movimentar pelo chão, em todas as direções, com o uso de rodas. As rodas devem ter diâmetro que permitam ultrapassar pequenos obstâculo no chão (p.e.: caricas) sem afetar a estabilidade do conjunto. Sobre essa base-robô serâ colocado o \"corpo\" humanóide do robô com outras partes de hardware (p.e.: câmera, microfone, colunas, etc.). Serâ necessârio criar uma API para que um computador remoto possa interagir/controlar o robô. Ex.: https://wowwee.com/products/robots',40,'Publicado',NULL,'Empresa114','Orientador poderâ ser alterado no processo de atribuição de TFC','p1059','emp40'),(115,'Criação de portal de colaborador em Odoo','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','Implementação de portal de interação com os colaboradores, baseado na tecnologia Odoo. Deverâ abarcar os seguintes processos: Férias, Faltas, Folhas de Horas, Recibos vencimento, Pedidos e suporte, Avaliação, Comunicações, Gamificação',41,'Publicado',NULL,'Empresa115','Orientador poderâ ser alterado no processo de atribuição de TFC','p5930','emp41'),(117,'Desenvolvimento de vârias aplicações solicitadas pelas âreas de negócio','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','Foram identificadas algumas necessidades de desenvolvimento e algumas aplicações de suporte ao negócio. O objetivo deste trabalho seria o de detalhar os requisitos das aplicações junto das âreas de negócio e o desenvolvimento das mesma em Outsystems.',42,'Publicado',NULL,'Empresa117','Orientador poderâ ser alterado no processo de atribuição de TFC','p2','emp42'),(248,'Test Automation - IPA (intelligent process automation) component to support business continuity management ','2021','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de um trabalho académico relacionado com componentes de IPA/RPA (Robotic Process Automation).\nEste componente aplicacional irâ ser baseado nos conceitos de automação de testes baseada em identificação fluxos (process mining), definição de resultados, deployment de fluxos de testes, anâlise de resultados e data mining.',78,'Publicado',NULL,'Empresa248','','p6255','emp78'),(250,'Aplicação mobile central de apps existentes','2021','Recusado','','2022-10-07','2022-10-07','O projeto passarâ pelo desenvolvimento de uma aplicação mobile, que interligarâ as aplicações existentes na empresa, a APP precisarâ de contar com um sistema de login com dados internos, sistema de folha de horas, chat com utilizadores, entre outras funções.\n',79,'Recusado',NULL,'Empresa250','duplicado do tema EMPRESA251','p2703','emp79'),(251,'Aplicação mobile central de apps existentes','2021','Aceite','','2022-10-07','2022-10-07','Pretende-se o desenvolvimento de uma APP mobile que interligarâ informações de APPs existentes, funcionarâ como uma APP central, pretende-se que disponha de um sistema de login com dados internos, permita aos colaboradores o preenchimento de folha de horas, terâ um chat entre utilizadores, outre outras funções.',79,'Publicado',NULL,'Empresa251','','p5932','emp79'),(261,'Id_Cap - Recolha de  dados de moradas de documentos normalizados','2021','Aceite','','2022-10-07','2022-10-07','O projeto consiste na construção de uma aplicação mobile que efetue a recolha de comprovativos de morada a partir de documentos normalizados (fatura da eletricidade, gâs, telecomunicações, etc) e que tenha a capacidade de detetar novos templates e sugerir criação / atualização dos mesmos.\n\nTema jâ atribuido',78,'Publicado',NULL,'Empresa261','','p6255','emp78'),(262,'Id_Cap - Recolha de  dados de moradas de documentos normalizados','2021','Aceite','','2022-10-07','2022-10-07','O projeto consiste na construção de uma aplicação mobile que efetue a recolha de comprovativos de morada a partir de documentos normalizados (fatura da eletricidade, gâs, telecomunicações, etc) e que tenha a capacidade de detetar novos templates e sugerir criação / atualização dos mesmos.\n',78,'Indisponivel',NULL,'Empresa262','','p6255','emp78'),(306,'APP Mobile de dispensârio Plantas Medicinais','2022','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de uma APP mobile em Android e IOS com informação sobre as indicações das plantas medicinais para a saúde e bem-estar. A APP terâ duas vertentes: 1) front-office que permite a consulta de dados de  Fitoquímica, Fitoterapia e Dispensârio das plantas medicinais, e benefícios para a saúde (validados pela EMA-UE); 2) back-office que permite gerir esses conteúdos. E uma interface segura. Critérios de pesquisa : a)  nome  da planta ;b) beneficio/risco procurado.\n',92,'Publicado',NULL,'Empresa306','','p5617','emp92'),(310,'SPAutores - Portal de Licenciamento','2022','Aceite','','2022-10-07','2022-10-07','Projecto Full Stack web (NodeJS + React) com o objectivo de criar um plataforma para as entidades inscritas na Sociedade Portuguesa de Autores gerirem o licenciamento dos seus estabelecimentos. O projecto incluiria criar um RESTful API em NodeJS utilizando o framework Express e um frontend em React. A plataforma permitiria às entidades visualizar informações relativas aos seus estabelecimentos, licenças activas, por pagar/pagas bem como dar opção de efectuar o pagamento directo das pendentes.',93,'Publicado',NULL,'Empresa310','','p6255','emp93'),(311,'SPA - Portal de licenciamento','2022','Recusado','','2022-10-07','2022-10-07','Projecto Full Stack web (NodeJS + React) com o objectivo de criar um plataforma para as entidades inscritas na Sociedade Portuguesa de Autores gerirem o licenciamento dos seus estabelecimentos. O projecto incluiria criar um RESTful API em NodeJS utilizando o framework Express e um frontend em React. A plataforma permitiria às entidades visualizar informações relativas aos seus estabelecimentos, licenças activas, por pagar/pagas bem como dar opção de efectuar o pagamento directo das pendentes.',93,'Recusado',NULL,'Empresa311','duplicado do tema 310','p2703','emp93'),(319,'AutoMecom Website (Oficina de Reparação de Automóveis)','2022','Aceite','','2022-10-07','2022-10-07','Este projeto consiste no desenvolvimento de um website para uma empresa de reparação de automóveis. Tendo como objetivo principal fornecer â empresa uma plataforma online que permita dar a conhecer aos clientes e âs pessoas que a procuram a empresa e o seu trabalho. Também terâ um papel fundamental na ajuda de produtividade e organização da mesma permitindo serem efetuadas marcações pelo website. Irâ também abranger outras âreas de trabalho e comércio contendo uma secção de venda de produtos.',96,'Publicado',NULL,'Empresa319','','p5932','emp96'),(320,'AutoMecom Website (Oficina de Reparação de Automóveis)','2022','Recusado','','2022-10-07','2022-10-07','Este projeto consiste no desenvolvimento de um website para uma empresa de reparação de automóveis. Tendo como objetivo principal fornecer â empresa uma plataforma online que permita dar a conhecer aos clientes e âs pessoas que a procuram a empresa e o seu trabalho. Também terâ um papel fundamental na ajuda de produtividade e organização da mesma permitindo serem efetuadas marcações pelo website. Irâ também abranger outras âreas de trabalho e comércio contendo uma secção de venda de produtos. ',96,'Publicado',NULL,'Empresa320','duplicado tema 319','p2703','emp96'),(33,'LINE UP','2018','Aceite Com Modificações','','2022-10-07','2022-10-07','Aplicação com finalidade informativa\nAplicação com 10 editores\nLogin pode ser efectuado através de email, número de telemóvel ou facebook.\nExistencia de 8 opções apos login:\nPerfil do utilizador\nCalendârio com os eventos marcados\nLIVE games (transmissao dos jogos em directo)\nJogadores (\"nome\", \"equipa\", \"posição\"\nTop charts (melhores jogadores da semana)\nEstatísticas (vitorias/derrotas/empates/pontos)\nAlmanaque (aba onde sera possivel realizar leituras de codigos vuforia)\nDefinições',13,'Atribuido',NULL,'Empresa33','acrescentadas disciplinas, orientador e tecnologia.\n\nAs indicações apenas são incluidas por obrigatoriedade da plataforma, estão sujeites a revisão\n','p5502','emp13'),(68,'Gestor de devedores interno','2018','Aceite','','2022-10-07','2022-10-07','Este protejo tem como objectivo agilizar/automatizar o processo de abate de dividas de cada consultor da empresa.  Com isto a empresa pretende ter uma webapp personalizada/costumizada ,feita de raiz seguindo os requisitos da empresa , onde todo o processo de gestão é controlado na mesma.  A recolha de dados da situação financeira é feita através do acesso a uma base dados. Para validar qualquer alteração nos valores em divida deverâ ser feito upload dos devidos comprovativos.',30,'Atribuido',NULL,'Empresa68','','p5617','emp30'),(104,'Aplicão para Gestão do Clube de Corrida e Caminhada','2019','Aceite','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação para gestão de actividades do Clube de Corrida e Caminhada de uma software house nacional. O projecto inclui o desenho da base de dados, assim como a implementação da funcionalidade de gestão de membros e actividades, e de alguns relatórios estatísticos (p.e. para controlo de orçamentos).\n\nO projecto jâ se encontra em andamento com o orientador Rodrigo Correia e o co-orientador Bruno Cipriano.',10,'Publicado',32,'G104','','p5653','a21703349'),(112,'Plataforma de resumos - De estudantes para estudantes ','2019','Aceite','','2022-10-07','2022-10-07','Neste TFC irâ ser desenvolvido um site e uma aplicação móvel de demonstração de resumos de qualidade para o estudo e promover o estudo independente e diârio fora das horas de aula.\nO site irâ permitir os alunos e professores observarem os resumos que são publicados. A função do professor é de moderador, enquanto a função dos alunos é publicar, votar e comentar sobre os resumos.\nA app serve de suporte ao site e tem como objectivo permitir aos alunos estudarem em condições que não permite um PC.',10,'Publicado',35,'G112','','p5932','a21703806'),(116,'Prognósticos de  Apostas Desportivas ','2019','Recusado','','2022-10-07','2022-10-07','A nossa aplicação tem como objetivo ajudar apostadores no mercado de apostas desportivas através de dicas de outros apostadores, funcionando ainda como uma comunidade de apostadores em que cada apostador possa dar a sua previsão para o jogo X, explicando (ou não) em seguida porque tomou essa escolha, através de um forum. Para alem da app estamos a pensar em criar um site.',10,'Recusado',39,'G116','Não tem conteúdo suficiente para TFC de duração anual','p5932','a21701870'),(118,'Prognósticos de  Apostas Desportivas ','2019','Aceite','','2022-10-07','2022-10-07','Esta app/site funciona como uma comunidade de apostadores em que cada\napostador possa dar a sua previsão para o jogo X, explicando (ou não)\nem seguida porque tomou essa escolha, através de um forum, tendo outras funcionalides como:\nComparação de odds dos diferentes sites de apostas e incluir um sistema de câlculo de odds. Dando uma ajuda ao utilizadores para escolher o melhor site para apostar.\nEstatísticas das equipas.\nPerfil de utilizador.\nSistema de ranking.\n',10,'Publicado',44,'G118','','p5290','a21701870'),(119,'Aplicação para Gestão e Planeamento Técnicos no Terreno','2019','Aceite','','2022-10-07','2022-10-07','Pretende-se criar uma aplicação Web, que suporta um modelo de subscrições, para controlar, gerir e planear técnicos no terreno. Esta plataforma incluirâ um backoffice, no qual podemos gerir todo o planeamento. Cada técnico ligado à subscrição vai poder instalar no seu dispositivo móvel a app para poder executar o serviço no terreno. Todas as funcionalidades do backoffice como das apps, serâ entregue ao docente.  ',10,'Publicado',46,'G119','','p5403','a21705846'),(120,'Matchmaking de Oferta e Procura de serviços','2019','Aceite','','2022-10-07','2022-10-07','O objetivo é a criação de uma plataforma onde uma entidade que queira contratar um serviço farâ um perfil com as suas referencias e, no caso de existir um utilizador individual com a totalidade ou a maioria dos requisitos do contratante, os dois são imediatamente colocados em contacto. O mesmo acontece para alguém que procura trabalho. (Ex: Uma escola de surf à procura de um instrutor no mês de Julho na Nazaré). Este sistema facilitarâ e automatizarâ o processo de procura e oferta.',10,'Publicado',47,'G120','','p5932','a21703906'),(121,'Optimização de atribuição de equipas para maximizar a capacidade de resposta','2019','Aceite','','2022-10-07','2022-10-07','App com gestão de pedidos de limpezas e respectiva atribuição das equipas necessârias. O utilizador envia fotos do local ou divisória que precisa de uma serviço de limpeza, posteriormente o sistema analisa todas as informações dadas pelo utilizador incluído fotos. Através de inteligência artificial o sistema avalia quantas pessoas são necessârias para limpar a divisão num curto espaço de tempo e atribui automaticamente uma das equipas para o pedido. Assim não é necessaria intervenção humana.',10,'Publicado',49,'G121','','p2703','a21703974'),(169,'Plataforma de emprego para recém graduados sem experiência profissional','2020','Aceite','','2022-10-07','2022-10-07','Plataforma de procura e oferta de emprego para recém graduados sem experiência profissional. Haverâ um mecanismo de busca e uma ârea  reservada às empresas onde podem anunciar vagas. Serâ utilizada a API do Linkedin para o registo de utilizadores e aconselhamento de vagas de acordo com perfis semelhantes existentes. Serão utilizadas outras APIs como Stack Overflow para recolha de vagas. Esta plataforma visa facilitar o encontro de vagas para pessoas sem experiência profissional de qualquer ârea.',10,'Publicado',52,'G169','','p5932','a21901796'),(175,'Aplicação Móvel para auxilio de donos de animais de estimação','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se desenvolver uma aplicação que permite auxiliar os donos de animais de estimação evitando o abandono dos mesmos por não ser possível levâ-los connosco.  Esta serâ uma aplicação que engloba um diverso leque de funcionalidades como: \n-A localização de locais onde é permitido a entrada dos animais (Hotéis, Restaurantes, parques,jardins,etc.)\n-Com o dia a dia e a saúde do animal (calendârio, marcação de vacinas, etc.)\n-Venda de comida/acessórios para animais através da aplicação.',10,'Publicado',54,'G175','','p5932','a21801685'),(191,'DEISI ASK','2020','Aceite','','2022-10-07','2022-10-07','Pretende-se criar uma plataforma de esclarecimentos de duvidas entre os alunos. Em semelhança com o piazza (https://piazza.com/class) queremos criar foruns e subforuns de dúvidas dadas pelos alunos, que possam ser respondidas tanto por alunos como docentes. Iremos criar um sistema de votação para que seja mostrada a resposta que mais alunos achem correta. Outra das funcionalidades passa por criar pequenas salas de video+voz para esclarecimento/aulas de grupo.',10,'Publicado',58,'G191','','p5932','a21901521'),(204,'InstaScraper','2020','Recusado','','2022-10-07','2022-10-07','Hoje em dia qualquer negócio usa o Instagram para marketing. Sendo uma das maiores redes sociais do mundo com cerca de 1 bilião de utilizadores diârios, tornando difíÂ­cil um empreendedor destacar o seu produto/empresa. O bom uso de hashtags é fundamental para isso acontecer. InstaScraper usa um web scraper para extrair e analisar quais os melhores hashtags usados pela concorrência, seleccionando e compilando as melhores opções para uma maior visibilidade de cada publicação na plataforma.',10,'Recusado',66,'G204','Proposta não validada com orientador','p5403','a21904353'),(254,'Aplicação Web com recurso à ferramenta OutSystems','2021','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de aplicação Web com recurso à ferramenta OutSystems que visa assegurar a aleatoridade de controlos de dopagem atravez da seleção aleatória de equipas de modalidades coletivas e respetivos atletas.\nA aplicação pretende garantir e registar para efeitos de auditoria que a seleção aleatória das equipas de determinada modalidade coletiva é feita de forma justa e imparcial.',10,'Publicado',84,'G254','','p2357','a20060775'),(255,'Combater o desperdício alimentar e \'controlar\' a despensa','2021','Aceite','','2022-10-07','2022-10-07','Pretende-se criar uma aplicação móvel para combater o desperdício alimentar. O objetivo é saber as datas de validade dos produtos que adquire e que tem na despensa, podendo receber notificações sobre a aproximação do fim da validade destes na altura em que desejar (um dia/uma semana/um mês antes) - sujeito a configuração pelo utilizador. Os artigos serão introduzidos e catalogados na app através do respetivo código de barras, de uma foto ou ainda manualmente. ',10,'Publicado',86,'G255','','p5617','a20076288'),(293,'Aplicação móvel para Parques de Campismo','2022','Aceite','','2022-10-07','2022-10-07','Aplicação móvel que permite consultar, comparar e reservar apartamentos/bungalows de parques de campismo em Portugal.\n\nTFC previamente discutido com o orientador Pedro Alves.',10,'Publicado',97,'G293','','p4997','a22001936'),(348,'Plataforma de gestão para uma  lavandaria e engomadoria','2022','Aceite','','2022-10-07','2022-10-07','Eu  tenho duas lojas destas e pretendemos criar uma plataforma que ajude a fazer a gestão da parte de engomadoria e também para gerir as mâquinas de lavar e secar.\nPretendemos que a plataforma nos diga a disponibilidade das mâquinas (se estão a ser utilizadas ou não.), queremos fazer uma ârea onde trabalhadores podem logar as suas entradas e saídas, gerir as peças que entram para a engomadoria, estatísticas de quantas peças cada funcionârio passa por dia.',98,'Publicado',116,'G348','','p5617','a22004314'),(106,'Sistema de autenticação para a Bateria Sistémica de Lisboa','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','A Bateria Sistémica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games, utilizada para a reabilitação cognitiva de pessoas com lesão cerebral adquirida. Estes pacientes têm habitualmente défices cognitivos que podem ser revertidos com a utilização de tarefas que replicam atividades da vida real, como aquelas que compõem a BSL. No entanto, esta prova carece ainda de um sistema de autenticação online que permita uma gestão de utilizadores, que é o objetivo deste projeto.',10,'Publicado',NULL,'NDEISI106','Orientador poderâ ser alterado no processo de atribuição de TFC','p3025','pnd4'),(107,'Base de dados de utilizadores da Bateria Sistémica de Lisboa','2019','Aceite','','2022-10-07','2022-10-07','A Bateria Sistémica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games (desenvolvido com Unity), utilizada para a reabilitação cognitiva de pessoas com lesão cerebral. Estes pacientes têm défices cognitivos que podem ser revertidos com a utilização de tarefas que replicam atividades da vida real, como aquelas que compõem a BSL. O objetivo deste projeto é migrar estas tarefas para um sistema que ofereça um modo de interação mais intuitivo, como os tablets com Android.',10,'Publicado',NULL,'NDEISI107','','p5502','pnd4'),(110,'Bateria Sistémica de Lisboa: Adaptação para tablet','2019','Aceite Com Modificações','','2022-10-07','2022-10-07','A Bateria Sistémica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games desenvolvidas em Unity e utilizadas para a reabilitação cognitiva de pessoas com lesão cerebral adquirida. Uma das limitações apontadas diz respeito ao modo de interação que é baseado nos periféricos de um PC que levantam dificuldades a estes utilizadores. Uma possibilidade é migração destas provas para um suporte mais intuitivo como os tablets, sendo este o objetivo deste projeto.',10,'Indisponivel',NULL,'NDEISI110','Orientador poderâ ser alterado no processo de atribuição de TFC','p5963','pnd4'),(36,'SmartMedia','2018','Aceite','','2022-10-07','2022-10-07','O projeto SP Smart Media visa a conceção e desenvolvimento de uma plataforma tecnológica inovadora, a nível mundial, para a gestão integrada de todo o processo de produção de ficção de longa duração da SP Televisão.\nNeste âmbito a equipa responsâvel na ULHT propõe a inclusão dos alunos Oleksiy Tavares nº 21803410  e Jorge Adrião nº 21702442 na equipa de desenvolvimento do projecto com a previsão da execução de tarefas que podem constituir a base para os seus respectivos TFC\'s.\n\n',15,'Atribuido',NULL,'NDEISI36','','p3113','pnd1'),(43,'Redes Neuronais Artificiais como auxiliar na terapêutica e acompanhamento clínico de doentes com a lesão aguda renal.','2018','Aceite','','2022-10-07','2022-10-07','Desenvolvimento de um algoritmo com base no conceito de Redes Neuronais Artificiais como auxiliar no diagnóstico e tratamento de doentes com lesão aguda renal, baseando-se num conjunto de dados biomédicos. O modelo permitirâ criar um sistema de diagnóstico, fundamental no que concerne à terapia mais adequada, representando uma vantagem em termos de rapidez nos tratamentos e poupança de recursos técnicos e humanos. A proposta terâ o acompanhamento do Prof. Francesco Costigliola.',10,'Atribuido',NULL,'NDEISI43','','p4855','pnd2'),(44,'Desenvolvimento de ferramentas de procura de moléculas com acção farmacológica através de técnicas de data mining e machine learning','2018','Aceite','','2022-10-07','2022-10-07','Actualmente, a procura de novos fârmacos tem merecido bastante interesse por parte dos grupos de investigação na ârea da biomedicina. O projecto que terâ o acompanhamento do Professor Francesco Costigliola, visa desenvolver um sistema de anâlise, classificação e associação de moléculas com possível acção terapêutica, tendo por base dados experimentais obtidos por espectroscopia de infra-vermelho, utilizando-se para o efeito as ferramentas de data mining e machine learning mais adequados.',10,'Indisponivel',NULL,'NDEISI44','','p4855','pnd2'),(45,'Carlos Relvas Full 3D. The Stereo Catalogue','2018','Aceite','','2022-10-07','2022-10-07','Este projecto de investigação procura apoio informâtico (programação e design web) para a criação de um catâlogo digital online de fotografias a partir de uma base de dados. O objectivo é combinar as fotografias estereoscópicas de Carlos Relvas (negativos e positivos) que se encontram dispersas em diferentes colecções públicas e privadas.\nUm dos catâlogos online de fotografia antiga a ter em conta é o do fotógrafo W.H. Fox Talbot: https://talbot.bodleian.ox.ac.uk/search',10,'Atribuido',NULL,'NDEISI45','','p5404','pnd3');
